-edit-param-summary','s:82:\"Edit summary. Also section title when $1section=new and $1sectiontitle is not set.\";'),('en','messages:apihelp-edit-param-tags','s:37:\"Change tags to apply to the revision.\";'),('en','messages:apihelp-edit-param-text','s:13:\"Page content.\";'),('en','messages:apihelp-edit-param-title','s:76:\"Title of the page to edit. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-edit-param-token','s:94:\"The token should always be sent as the last parameter, or at least after the $1text parameter.\";'),('en','messages:apihelp-edit-param-undo','s:69:\"Undo this revision. Overrides $1text, $1prependtext and $1appendtext.\";'),('en','messages:apihelp-edit-param-undoafter','s:79:\"Undo all revisions from $1undo to this one. If not set, just undo one revision.\";'),('en','messages:apihelp-edit-param-unwatch','s:50:\"Remove the page from the current user\'s watchlist.\";'),('en','messages:apihelp-edit-param-watch','s:45:\"Add the page to the current user\'s watchlist.\";'),('en','messages:apihelp-edit-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-edit-param-watchlistexpiry','s:95:\"Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-edit-summary','s:22:\"Create and edit pages.\";'),('en','messages:apihelp-emailuser-example-email','s:80:\"Send an email to the user <kbd>WikiSysop</kbd> with the text <kbd>Content</kbd>.\";'),('en','messages:apihelp-emailuser-param-ccme','s:31:\"Send a copy of this mail to me.\";'),('en','messages:apihelp-emailuser-param-subject','s:15:\"Subject header.\";'),('en','messages:apihelp-emailuser-param-target','s:26:\"User to send the email to.\";'),('en','messages:apihelp-emailuser-param-text','s:11:\"Email body.\";'),('en','messages:apihelp-emailuser-summary','s:13:\"Email a user.\";'),('en','messages: