anges-example-simple','s:20:\"Show recent changes.\";'),('en','messages:apihelp-feedrecentchanges-param-associated','s:44:\"Include associated (talk or main) namespace.\";'),('en','messages:apihelp-feedrecentchanges-param-days','s:29:\"Days to limit the results to.\";'),('en','messages:apihelp-feedrecentchanges-param-feedformat','s:23:\"The format of the feed.\";'),('en','messages:apihelp-feedrecentchanges-param-from','s:24:\"Show changes since then.\";'),('en','messages:apihelp-feedrecentchanges-param-hideanons','s:37:\"Hide changes made by anonymous users.\";'),('en','messages:apihelp-feedrecentchanges-param-hidebots','s:26:\"Hide changes made by bots.\";'),('en','messages:apihelp-feedrecentchanges-param-hidecategorization','s:33:\"Hide category membership changes.\";'),('en','messages:apihelp-feedrecentchanges-param-hideliu','s:38:\"Hide changes made by registered users.\";'),('en','messages:apihelp-feedrecentchanges-param-hideminor','s:19:\"Hide minor changes.\";'),('en','messages:apihelp-feedrecentchanges-param-hidemyself','s:38:\"Hide changes made by the current user.\";'),('en','messages:apihelp-feedrecentchanges-param-hidepatrolled','s:23:\"Hide patrolled changes.\";'),('en','messages:apihelp-feedrecentchanges-param-invert','s:36:\"All namespaces but the selected one.\";'),('en','messages:apihelp-feedrecentchanges-param-limit','s:36:\"Maximum number of results to return.\";'),('en','messages:apihelp-feedrecentchanges-param-namespace','s:34:\"Namespace to limit the results to.\";'),('en','messages:apihelp-feedrecentchanges-param-showlinkedto','s:58:\"Show changes on pages linked to the selected page instead.\";'),('en','messages:apihelp-feedrecentchanges-param-tagfilter','s:14:\"Filter by tag.\";'),('en','messages:apihelp-feedrecentchanges-param-target','s:49:\"Show only changes on pages linked from this page.\";'),('en','messages:apihelp-feedrecentchanges-summary','s:30:\"Returns a recent changes feed.\";'),('en','messages:apihelp-feedwatchlist-example-all6hrs','s:54:\"Show all changes to watched pages in the past 6 hours.\";'),('en','messages:apihelp-feedwatchlist-example-default','s:24:\"Show the watchlist feed.\";'),('en','messages:apihelp-feedwatchlist-param-feedformat','s:23:\"The format of the feed.\";'),('en','messages:apihelp-feedwatchlist-param-hours','s:52:\"List pages modified within this many hours from now.\";'),('en','messages:apihelp-feedwatchlist-param-linktosections','s:46:\"Link directly to changed sections if possible.\";'),('en','messages:apihelp-feedwatchlist-summary','s:25:\"Returns a watchlist feed.\";'),('en','messages:apihelp-filerevert-example-revert','s:77:\"Revert <kbd>Wiki.png</kbd> to the version of <kbd>2011-03-05T15:27:40Z</kbd>.\";'),('en','messages:apihelp-filerevert-param-archivename','s:42:\"Archive name of the revision to revert to.\";'),('en','messages:apihelp-filerevert-param-comment','s:15:\"Upload comment.\";'),('en','messages:apihelp-filerevert-param-filename','s:42:\"Target filename, without the File: prefix.\";'),('en','messages:apihelp-filerevert-summary','s:32:\"Revert a file to an old version.\";'),('en','messages:apihelp-format-example-generic','s:41:\"Return the query result in the $1 format.\";'),('en','messages:apihelp-format-param-wrappedhtml','s:86:\"Return the pretty-printed HTML and associated ResourceLoader modules as a JSON object.\";'),('en','messages:apihelp-help-example-help','s:32:\"Help for the help module itself.\";'),('en','messages:apihelp-help-example-main','s:25:\"Help for the main module.\";'),('en','messages:apihelp-help-example-query','s:30:\"Help for two query submodules.\";'),('en','messages:apihelp-help-example-recursive','s:21:\"All help in one page.\";'),('en','messages:apihelp-help-example-submodules','s:56:\"Help for <kbd>action=query</kbd> and all its submodules.\";'),('en','messages:apihelp-help-param-helpformat','s:26:\"Format of the help output.\";'),('en','messages:apihelp-help-param-modules','s:159:\"Modules to display help for (values o