clude local messages, i.e. messages that don\'t exist in the software but do exist as in the {{ns:MediaWiki}} namespace.\nThis lists all {{ns:MediaWiki}}-namespace pages, so it will also list those that aren\'t really messages such as [[MediaWiki:Common.js|Common.js]].\";'),('en','messages:apihelp-query+allmessages-param-lang','s:33:\"Return messages in this language.\";'),('en','messages:apihelp-query+allmessages-param-messages','s:68:\"Which messages to output. <kbd>*</kbd> (default) means all messages.\";'),('en','messages:apihelp-query+allmessages-param-nocontent','s:65:\"If set, do not include the content of the messages in the output.\";'),('en','messages:apihelp-query+allmessages-param-prefix','s:33:\"Return messages with this prefix.\";'),('en','messages:apihelp-query+allmessages-param-prop','s:24:\"Which properties to get.\";'),('en','messages:apihelp-query+allmessages-param-title','s:77:\"Page name to use as context when parsing message (for $1enableparser option).\";'),('en','messages:apihelp-query+allmessages-param-to','s:39:\"Return messages ending at this message.\";'),('en','messages:apihelp-query+allmessages-summary','s:31:\"Return messages from this site.\";'),('en','messages:apihelp-query+allpages-example-b','s:57:\"Show a list of pages starting at the letter <kbd>B</kbd>.\";'),('en','messages:apihelp-query+allpages-example-generator','s:60:\"Show info about 4 pages starting at the letter <kbd>T</kbd>.\";'),('en','messages:apihelp-query+allpages-example-generator-revisions','s:70:\"Show content of first 2 non-redirect pages beginning at <kbd>Re</kbd>.\";'),('en','messages:apihelp-query+allpages-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+allpages-param-filterlanglinks','s:108:\"Filter based on whether a page has langlinks. Note that this may not consider langlinks added by extensions.\";'),('en','messages:apihelp-query+allpages-param-filterredir','s:20:\"Which pages to list.\";'),('en','messages:apihelp-query+allpages-param-from','s:41:\"The page title to start enumerating from.\";'),('en','messages:apihelp-query+allpages-param-limit','s:31:\"How many total pages to return.\";'),('en','messages:apihelp-query+allpages-param-maxsize','s:44:\"Limit to pages with at most this many bytes.\";'),('en','messages:apihelp-query+allpages-param-minsize','s:45:\"Limit to pages with at least this many bytes.\";'),('en','messages:apihelp-query+allpages-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+allpages-param-prefix','s:54:\"Search for all page titles that begin with this value.\";'),('en','messages:apihelp-query+allpages-param-prexpiry','s:223:\"Which protection expiry to filter the page on:\n;indefinite:Get only pages with indefinite protection expiry.\n;definite:Get only pages with a definite (specific) protection expiry.\n;all:Get pages with any protections expiry.\";'),('en','messages:apihelp-query+allpages-param-prfiltercascade','s:76:\"Filter protections based on cascadingness (ignored when $1prtype isn\'t set).\";'),('en','messages:apihelp-query+allpages-param-prlevel','s:85:\"Filter protections based on protection level (must be used with $1prtype= parameter).\";'),('en','messages:apihelp-query+allpages-param-prtype','s:30:\"Limit to protected pages only.\";'),('en','messages:apihelp-query+allpages-param-to','s:38:\"The page title to stop enumerating at.\";'),('en','messages:apihelp-query+allpages-summary','s:54:\"Enumerate all pages sequentially in a given namespace.\";'),('en','messages:apihelp-query+allredirects-example-b','s:97:\"List target pages, including missing ones, with page IDs they are from, starting at <kbd>B</kbd>.\";'),('en','messages:apihelp-query+allredirects-example-generator','s:36:\"Gets pages containing the redirects.\";'),('en','messages:apihelp-query+allredirects-example-unique','s:25:\"List unique target pages.\";'),('en','messages:apihelp-query+allredirects-example-unique-generator','s:48:\"Gets all targ