\";'),('en','messages:apihelp-query+allrevisions-param-end','s:37:\"The timestamp to stop enumerating at.\";'),('en','messages:apihelp-query+allrevisions-param-excludeuser','s:34:\"Don\'t list revisions by this user.\";'),('en','messages:apihelp-query+allrevisions-param-generatetitles','s:73:\"When being used as a generator, generate titles rather than revision IDs.\";'),('en','messages:apihelp-query+allrevisions-param-namespace','s:34:\"Only list pages in this namespace.\";'),('en','messages:apihelp-query+allrevisions-param-start','s:40:\"The timestamp to start enumerating from.\";'),('en','messages:apihelp-query+allrevisions-param-user','s:33:\"Only list revisions by this user.\";'),('en','messages:apihelp-query+allrevisions-summary','s:19:\"List all revisions.\";'),('en','messages:apihelp-query+alltransclusions-example-b','s:103:\"List transcluded titles, including missing ones, with page IDs they are from, starting at <kbd>B</kbd>.\";'),('en','messages:apihelp-query+alltransclusions-example-generator','s:40:\"Gets pages containing the transclusions.\";'),('en','messages:apihelp-query+alltransclusions-example-unique','s:31:\"List unique transcluded titles.\";'),('en','messages:apihelp-query+alltransclusions-example-unique-generator','s:54:\"Gets all transcluded titles, marking the missing ones.\";'),('en','messages:apihelp-query+alltransclusions-param-dir','s:31:\"The direction in which to list.\";'),('en','messages:apihelp-query+alltransclusions-param-from','s:56:\"The title of the transclusion to start enumerating from.\";'),('en','messages:apihelp-query+alltransclusions-param-limit','s:31:\"How many total items to return.\";'),('en','messages:apihelp-query+alltransclusions-param-namespace','s:27:\"The namespace to enumerate.\";'),('en','messages:apihelp-query+alltransclusions-param-prefix','s:61:\"Search for all transcluded titles that begin with this value.\";'),('en','messages:apihelp-query+alltransclusions-param-prop','s:39:\"Which pieces of information to 