apihelp-query+logevents-paramvalue-prop-user','s:44:\"Adds the user responsible for the log event.\";'),('en','messages:apihelp-query+logevents-paramvalue-prop-userid','s:55:\"Adds the user ID who was responsible for the log event.\";'),('en','messages:apihelp-query+logevents-summary','s:21:\"Get events from logs.\";'),('en','messages:apihelp-query+mystashedfiles-example-simple','s:87:\"Get the filekey, file size, and pixel size of files in the current user\'s upload stash.\";'),('en','messages:apihelp-query+mystashedfiles-param-limit','s:22:\"How many files to get.\";'),('en','messages:apihelp-query+mystashedfiles-param-prop','s:40:\"Which properties to fetch for the files.\";'),('en','messages:apihelp-query+mystashedfiles-paramvalue-prop-size','s:41:\"Fetch the file size and image dimensions.\";'),('en','messages:apihelp-query+mystashedfiles-paramvalue-prop-type','s:42:\"Fetch the file\'s MIME type and media type.\";'),('en','messages:apihelp-query+mystashedfiles-summary','s:55:\"Get a list of files in the current user\'s upload stash.\";'),('en','messages:apihelp-query+pagepropnames-example-simple','s:28:\"Get first 10 property names.\";'),('en','messages:apihelp-query+pagepropnames-param-limit','s:38:\"The maximum number of names to return.\";'),('en','messages:apihelp-query+pagepropnames-summary','s:48:\"List all page property names in use on the wiki.\";'),('en','messages:apihelp-query+pageprops-example-simple','s:75:\"Get properties for the pages <kbd>Main Page</kbd> and <kbd>MediaWiki</kbd>.\";'),('en','messages:apihelp-query+pageprops-param-prop','s:215:\"Only list these page properties (<kbd>[[Special:ApiHelp/query+pagepropnames|action=query&list=pagepropnames]]</kbd> returns page property names in use). Useful for checking whether pages use a certain page property.\";'),('en','messages:apihelp-query+pageprops-summary','s:56:\"Get various page properties defined in the page content.\";'),('en','messages:apihelp-query+pageswithprop-example-generator','s:89: