its to page <kbd>Main Page</kbd> by user <kbd>Example</kbd>.\";'),('en','messages:apihelp-rollback-example-summary','s:180:\"Roll back the last edits to page <kbd>Main Page</kbd> by IP user <kbd>192.0.2.5</kbd> with summary <kbd>Reverting vandalism</kbd>, and mark those edits and the revert as bot edits.\";'),('en','messages:apihelp-rollback-extended-description','s:96:\"If the last user who edited the page made multiple edits in a row, they will all be rolled back.\";'),('en','messages:apihelp-rollback-param-markbot','s:52:\"Mark the reverted edits and the revert as bot edits.\";'),('en','messages:apihelp-rollback-param-pageid','s:82:\"Page ID of the page to roll back. Cannot be used together with <var>$1title</var>.\";'),('en','messages:apihelp-rollback-param-summary','s:60:\"Custom edit summary. If empty, default summary will be used.\";'),('en','messages:apihelp-rollback-param-tags','s:30:\"Tags to apply to the rollback.\";'),('en','messages:apihelp-rollback-param-title','s:81:\"Title of the page to roll back. Cannot be used together with <var>$1pageid</var>.\";'),('en','messages:apihelp-rollback-param-user','s:51:\"Name of the user whose edits are to be rolled back.\";'),('en','messages:apihelp-rollback-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-rollback-param-watchlistexpiry','s:95:\"Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-rollback-summary','s:31:\"Undo the last edit to the page.\";'),('en','messages:apihelp-rsd-example-simple','s:22:\"Export the RSD schema.\";'),('en','messages:apihelp-rsd-summary','s:47:\"Export an RSD (Really Simple Discovery) schema.\";'),('en','messages:apihelp-setnotificationtimestamp-example-all','s:55:\"Reset the notification status for the entire watchlist.\";'),('en','messages:apihelp-setnotificationtimestamp-example-allpages','s:80:\"Reset the notification status for pages in the <kbd>{{ns:user}}</kbd> namespace.\";'),('en','messages:apihelp-setnotificationtimestamp-example-page','s:55:\"Reset the notification status for <kbd>Main page</kbd>.\";'),('en','messages:apihelp-setnotificationtimestamp-example-pagetimestamp','s:103:\"Set the notification timestamp for <kbd>Main page</kbd> so all edits since 1 January 2012 are unviewed.\";'),('en','messages:apihelp-setnotificationtimestamp-extended-description','s:168:\"This affects the highlighting of changed pages in the watchlist and history, and the sending of email when the \"{{int:tog-enotifwatchlistpages}}\" preference is enabled.\";'),('en','messages:apihelp-setnotificationtimestamp-param-entirewatchlist','s:26:\"Work on all watched pages.\";'),('en','messages:apihelp-setnotificationtimestamp-param-newerthanrevid','s:70:\"Revision to set the notification timestamp newer than (one page only).\";'),('en','messages:apihelp-setnotificationtimestamp-param-timestamp','s:53:\"Timestamp to which to set the notification timestamp.\";'),('en','messages:apihelp-setnotificationtimestamp-param-torevid','s:62:\"Revision to set the notification timestamp to (one page only).\";'),('en','messages:apihelp-setnotificationtimestamp-summary','s:52:\"Update the notification timestamp for watched pages.\";'),('en','messages:apihelp-setpagelanguage-example-default','s:83:\"Change the language of the page with ID 123 to the wiki\'s default content language.\";'),('en','messages:apihelp-setpagelanguage-example-language','s:54:\"Change the language of <kbd>Main Page</kbd> to Basque.\";'),('en','messages:apihelp-setpagelanguage-extended-description-disabled','s:174:\"Changing the language of a page is not allowed on this wiki.\n\nEnable <var>[[mw:Special:MyLanguage/Manual:$wgPageLanguageUseDB|$wgPageLanguageUseDB]]</var> to use this action.\";'),('en','messages:apihelp-setpagelanguage-param-lang','s:133:\"Language code of the language to change the page to. Use <