n','messages:apihelp-undelete-param-watchlistexpiry','s:95:\"Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-undelete-summary','s:36:\"Restore revisions of a deleted page.\";'),('en','messages:apihelp-unlinkaccount-example-simple','s:111:\"Attempt to remove the current user\'s link for the provider associated with <kbd>FooAuthenticationRequest</kbd>.\";'),('en','messages:apihelp-unlinkaccount-summary','s:58:\"Remove a linked third-party account from the current user.\";'),('en','messages:apihelp-upload-example-filekey','s:47:\"Complete an upload that failed due to warnings.\";'),('en','messages:apihelp-upload-example-url','s:18:\"Upload from a URL.\";'),('en','messages:apihelp-upload-extended-description','s:547:\"Several methods are available:\n* Upload file contents directly, using the <var>$1file</var> parameter.\n* Upload the file in pieces, using the <var>$1filesize</var>, <var>$1chunk</var>, and <var>$1offset</var> parameters.\n* Have the MediaWiki server fetch a file from a URL, using the <var>$1url</var> parameter.\n* Complete an earlier upload that failed due to warnings, using the <var>$1filekey</var> parameter.\nNote that the HTTP POST must be done as a file upload (i.e. using <code>multipart/form-data</code>) when sending the <var>$1file</var>.\";'),('en','messages:apihelp-upload-param-async','s:66:\"Make potentially large file operations asynchronous when possible.\";'),('en','messages:apihelp-upload-param-checkstatus','s:52:\"Only fetch the upload status for the given file key.\";'),('en','messages:apihelp-upload-param-chunk','s:15:\"Chunk contents.\";'),('en','messages:apihelp-upload-param-comment','s:103:\"Upload comment. Also used as the initial page text for new files if <var>$1text</var> is not specified.\";'),('en','messages:apihelp-upload-param-file','s:14:\"File contents.\";'),('en','messages:apihelp-upload-param-filekey','s:67:\"Key that identifies a previous upload that was stashed temporarily.\";'),('en','messages:apihelp-upload-param-filename','s:16:\"Target filename.\";'),('en','messages:apihelp-upload-param-filesize','s:26:\"Filesize of entire upload.\";'),('en','messages:apihelp-upload-param-ignorewarnings','s:20:\"Ignore any warnings.\";'),('en','messages:apihelp-upload-param-offset','s:25:\"Offset of chunk in bytes.\";'),('en','messages:apihelp-upload-param-sessionkey','s:57:\"Same as $1filekey, maintained for backward compatibility.\";'),('en','messages:apihelp-upload-param-stash','s:90:\"If set, the server will stash the file temporarily instead of adding it to the repository.\";'),('en','messages:apihelp-upload-param-tags','s:68:\"Change tags to apply to the upload log entry and file page revision.\";'),('en','messages:apihelp-upload-param-text','s:32:\"Initial page text for new files.\";'),('en','messages:apihelp-upload-param-url','s:27:\"URL to fetch the file from.\";'),('en','messages:apihelp-upload-param-watch','s:15:\"Watch the page.\";'),('en','messages:apihelp-upload-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('en','messages:apihelp-upload-param-watchlistexpiry','s:95:\"Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('en','messages:apihelp-upload-summary','s:52:\"Upload a file, or get the status of pending uploads.\";'),('en','messages:apihelp-userrights-example-expiry','s:72:\"Add user <kbd>SometimeSysop</kbd> to group <kbd>sysop</kbd> for 1 month.\";'),('en','messages:apihelp-userrights-example-user','s:118:\"Add user <kbd>FooBot</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-userrights-example-userid','s:127:\"Add the user with ID <kbd>123</kbd> to group <kbd>bot</kbd>, and remove from groups <kbd>sysop</kbd> and <kbd>bureaucrat</kbd>.\";'),('en','messages:apihelp-userrights-param-add','s:115:\"Add the user to these groups, or if they are already a member, update the expiry of their membership in that group.\";'),('en','messages:apihelp-userrights-param-expiry','s:360:\"Expiry timestamps. May be relative (e.g. <kbd>5 months</kbd> or <kbd>2 weeks</kbd>) or absolute (e.g. <kbd>2014-09-18T12:34:56Z</kbd>). If only one timestamp is set, it will be used for all groups passed to the <var>$1add</var> parameter. Use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd>, or <kbd>never</kbd> for a never-expiring user group.\";'),('en','messages:apihelp-userrights-param-reason','s:22:\"Reason for the change.\";'),('en','messages:apihelp-userrights-param-remove','s:34:\"Remove the user from these groups.\";'),('en','messages:apihelp-userrights-param-tags','s:57:\"Change tags to apply to the entry in the user rights log.\";'),('en','messages:apihelp-userrights-param-user','s:5:\"User.\";'),('en','messages:apihelp-userrights-param-userid','s:49:\"Specify <kbd>$1user=#<var>ID</var></kbd> instead.\";'),('en','messages:apihelp-userrights-summary','s:33:\"Change a user\'s group membership.\";'),('en','messages:apihelp-validatepassword-example-1','s:61:\"Validate the password <kbd>foobar</kbd> for the current user.\";'),('en','messages:apihelp-validatepassword-example-2','s:77:\"Validate the password <kbd>qwerty</kbd> for creating user <kbd>Example</kbd>.\";'),('en','messages:apihelp-validatepassword-extended-description','s:206:\"Validity is reported as <samp>Good</samp> if the password is acceptable, <samp>Change</samp> if the password may be used for login but must be changed, or <samp>Invalid</samp> if the password is not usable.\";'),('en','messages:apihelp-validatepassword-param-email','s:53:\"Email address, for use when testing account creation.\";'),('en','messages:apihelp-validatepassword-param-password','s:21:\"Password to validate.\";'),('en','messages:apihelp-validatepassword-param-realname','s:49:\"Real name, for use when testing account creation.\";'),('en','messages:apihelp-validatepassword-param-user','s:80:\"User name, for use when testing account creation. The named user must not exist.\";'),('en','messages:apihelp-validatepassword-summary','s:57:\"Validate a password against the wiki\'s password policies.\";'),('en','messages:apihelp-visualeditor-description','s:50:\"Returns HTML5 for a page from the Parsoid service.\";'),('en','messages:apihelp-visualeditor-param-badetag','s:87:\"If RESTBase query returned a seemingly invalid ETag, pass it here for logging purposes.\";'),('en','messages:apihelp-visualeditor-param-basetimestamp','s:102:\"When saving, set this to the timestamp of the revision that was edited. Used to detect edit conflicts.\";'),('en','messages:apihelp-visualeditor-param-cachekey','s:110:\"For serialize or diff, use the result of a previous serializeforcache request with this key. Overrides $1html.\";'),('en','messages:apihelp-visualeditor-param-editintro','s:29:\"Edit intro to add to notices.\";'),('en','messages:apihelp-visualeditor-param-etag','s:13:\"ETag to send.\";'),('en','messages:apihelp-visualeditor-param-format','s:25:\"The format of the output.\";'),('en','messages:apihelp-visualeditor-param-html','s:47:\"HTML to send to Parsoid to convert to wikitext.\";'),('en','messages:apihelp-visualeditor-param-oldid','s:57:\"The revision number to use (defaults to latest revision).\";'),('en','messages:apihelp-visualeditor-param-paction','s:18:\"Action to perform.\";'),('en','messages:apihelp-visualeditor-param-page','s:31:\"The page to perform actions on.\";'),('en','messages:apihelp-visualeditor-param-preload','s:68:\"The page to use content from if the fetched page has no content yet.\";'),('en','messages:apihelp-visualeditor-param-preloadparams','s:59:\"Parameters to substitute into the preload page, if present.\";'),('en','messages:apihelp-visualeditor-param-pst','s:81:\"Pre-save transform wikitext before sending it to Parsoid (paction=parsefragment).\";'),('en','mes