ages:export-addns','s:3:\"Add\";'),('en','messages:export-addnstext','s:25:\"Add pages from namespace:\";'),('en','messages:export-download','s:12:\"Save as file\";'),('en','messages:export-manual','s:19:\"Add pages manually:\";'),('en','messages:export-pagelinks','s:35:\"Include linked pages to a depth of:\";'),('en','messages:export-submit','s:6:\"Export\";'),('en','messages:export-summary','s:0:\"\";'),('en','messages:export-templates','s:17:\"Include templates\";'),('en','messages:exportall','s:16:\"Export all pages\";'),('en','messages:exportcuronly','s:55:\"Include only the current revision, not the full history\";'),('en','messages:exportlistauthors','s:49:\"Include a full list of contributors for each page\";'),('en','messages:exportnohistory','s:127:\"----\n<strong>Note:</strong> Exporting the full history of pages through this form has been disabled due to performance reasons.\";'),('en','messages:exporttext','s:588:\"You can export the text and editing history of a particular page or set of pages wrapped in some XML.\nThis can be imported into another wiki using MediaWiki via the [[Special:Import|import page]].\n\nTo export pages, enter the titles in the text box below, one title per line, and select whether you want the current revision as well as all old revisions, with the page history lines, or the current revision with the info about the last edit.\n\nIn the latter case you can also use a link, for example [[{{#Special:Export}}/{{MediaWiki:Mainpage}}]] for the page \"[[{{MediaWiki:Mainpage}}]]\".\";'),('en','messages:external_image_whitelist','s:440:\" #Leave this line exactly as it is<pre>\n#Put regular expression fragments (just the part that goes between the //) below\n#These will be matched with the URLs of external (hotlinked) images\n#Those that match will be displayed as images, otherwise only a link to the image will be shown\n#Lines beginning with # are treated as comments\n#This is case-insensitive\n\n#Put all regex fragments above this lin