, il tuo indirizzo IP sarà registrato nella cronologia della pagina.</em>\";'),('it','messages:anontalk','s:11:\"discussioni\";'),('it','messages:anontalkpagetext','s:545:\"----\n<em>Questa è la pagina di discussione di un utente anonimo, che non ha ancora creato un\'utenza o comunque non la sta usando.</em>\nPer identificarlo è quindi necessario usare il numero del suo indirizzo IP.\nGli indirizzi IP possono però essere condivisi da più utenti.\nSe sei un utente anonimo e ritieni che i commenti presenti in questa pagina non si riferiscano a te, [[Special:CreateAccount|crea una nuova utenza]] o [[Special:UserLogin|entra con quella che già hai]] per evitare di essere confuso con altri utenti anonimi in futuro.\";'),('it','messages:anonuser','s:34:\"$1, utente anonimo di {{SITENAME}}\";'),('it','messages:anonusers','s:63:\"$1, {{PLURAL:$2|utente anonimo|utenti anonimi}} di {{SITENAME}}\";'),('it','messages:anonymous','s:59:\"{{PLURAL:$1|Utente anonimo|Utenti anonimi}} di {{SITENAME}}\";'),('it','messages:api-clientside-error-aborted','s:24:\"The request was aborted.\";'),('it','messages:api-clientside-error-http','s:31:\"Server returned error: HTTP $1.\";'),('it','messages:api-clientside-error-invalidresponse','s:29:\"Invalid response from server.\";'),('it','messages:api-clientside-error-noconnect','s:96:\"Could not connect to the server. Make sure you have a working internet connection and try again.\";'),('it','messages:api-clientside-error-timeout','s:50:\"Il server non ha risposto entro il tempo previsto.\";'),('it','messages:api-credits','s:370:\"API developers:\n* Yuri Astrakhan (creator, lead developer Sep 2006–Sep 2007)\n* Roan Kattouw (lead developer Sep 2007–2009)\n* Victor Vasiliev\n* Bryan Tong Minh\n* Sam Reed\n* Brad Jorsch (lead developer 2013–present)\n\nPlease send your comments, suggestions and questions to mediawiki-api@lists.wikimedia.org\nor file a bug report at https://phabricator.wikimedia.org/.\";'),('it','messages:api-credits-header','s:7:\"Crediti\";'),('it','messages:api-error-badtoken','s:29:\"Errore interno: token errato.\";'),('it','messages:api-error-emptypage','s:53:\"La creazione di nuove pagine vuote non è consentita.\";'),('it','messages:api-error-publishfailed','s:79:\"Errore interno: il server non è riuscito a pubblicare il documento temporaneo.\";'),('it','messages:api-error-stashfailed','s:80:\"Errore interno: il server non è riuscito a memorizzare il documento temporaneo.\";'),('it','messages:api-error-unknown-warning','s:31:\"Avvertimento sconosciuto: \"$1\".\";'),('it','messages:api-error-unknownerror','s:25:\"Errore sconosciuto: \"$1\".\";'),('it','messages:api-exception-trace','s:15:\"$1 at $2($3)\n$4\";'),('it','messages:api-feed-error-title','s:10:\"Error ($1)\";'),('it','messages:api-format-prettyprint-header','s:391:\"This is the HTML representation of the $1 format. HTML is good for debugging, but is unsuitable for application use.\n\nSpecify the <var>format</var> parameter to change the output format. To see the non-HTML representation of the $1 format, set <kbd>format=$2</kbd>.\n\nSee the [[mw:Special:MyLanguage/API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('it','messages:api-format-prettyprint-header-hyperlinked','s:377:\"This is the HTML representation of the $1 format. HTML is good for debugging, but is unsuitable for application use.\n\nSpecify the <var>format</var> parameter to change the output format. To see the non-HTML representation of the $1 format, set [$3 <kbd>format=$2</kbd>].\n\nSee the [[mw:API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('it','messages:api-format-prettyprint-header-only-html','s:219:\"This is an HTML representation intended for debugging, and is unsuitable for application use.\n\nSee the [[mw:Special:MyLanguage/API|complete documentation]], or the [[Special:ApiHelp/main|API help]] for more information.\";'),('it','messages:api-format-prettyprint-status','s:55:\"This response would be returned with HTTP status $1 $2.\";'),('it','messages:api-format-title','s:20:\"MediaWiki API result\";'),('it','messages:api-help-authmanager-general-usage','s:1312:\"La procedura generale per usare questo modulo è:\n# Ottenere i campi disponibili da <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> con <kbd>amirequestsfor=$4</kbd>, e un token <kbd>$5</kbd> da <kbd>[[Special:ApiHelp/query+tokens|action=query&meta=tokens]]</kbd>.\n# Mostra i campi all\'utente e ottieni i dati che invia.\n# Esegui un post a questo modulo, fornendo <var>$1returnurl</var> e ogni campo rilevante.\n# Controlla <samp>status</samp> nella response.\n#* Se hai ricevuto <samp>PASS</samp> o <samp>FAIL</samp>, hai finito. L\'operazione nel primo caso è andata a buon fine, nel secondo no.\n#* Se hai ricevuto <samp>UI</samp>, mostra i nuovi campi all\'utente e ottieni i dati che invia. Esegui un post a questo modulo con <var>$1continue</var> e i campi rilevanti settati, quindi ripeti il punto 4.\n#* Se hai ricevuto <samp>REDIRECT</samp>, dirigi l\'utente a <samp>redirecttarget</samp> e aspetta che ritorni a <var>$1returnurl</var>. A quel punto esegui un post a questo modulo con <var>$1continue</var> e ogni campo passato all\'URL di ritorno, e ripeti il punto 4.\n#* Se hai ricevuto <samp>RESTART</samp>, vuol dire che l\'autenticazione ha funzionato ma non abbiamo un account collegato. Potresti considerare questo caso come <samp>UI</samp> o come <samp>FAIL</samp>.\";'),('it','messages:api-help-authmanagerhelper-additional-params','s:357:\"Questo modulo accetta parametri aggiuntivi a seconda delle richieste di autenticazione disponibili. Utilizza <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> con <kbd>amirequestsfor=$1</kbd> (o una precedente risposta da questo modulo, se applicabile) per determinare le richieste disponibili e i campi usati da queste.\";'),('it','messages:api-help-authmanagerhelper-continue','s:170:\"Questa richiesta è una continuazione dopo una precedente risposta <samp>UI</samp> o <samp>REDIRECT</samp>. È necessario fornirlo, oppure fornire <var>$1returnurl</var>.\";'),('it','messages:api-help-authmanagerhelper-mergerequestfields','s:71:\"Merge field information for all authentication requests into one array.\";'),('it','messages:api-help-authmanagerhelper-messageformat','s:59:\"Formato da utilizzare per per la restituzione dei messaggi.\";'),('it','messages:api-help-authmanagerhelper-preservestate','s:83:\"Conserva lo stato da un precedente tentativo di accesso non riuscito, se possibile.\";'),('it','messages:api-help-authmanagerhelper-request','s:191:\"Use this authentication request, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd>.\";'),('it','messages:api-help-authmanagerhelper-requests','s:243:\"Only use these authentication requests, by the <samp>id</samp> returned from <kbd>[[Special:ApiHelp/query+authmanagerinfo|action=query&meta=authmanagerinfo]]</kbd> with <kbd>amirequestsfor=$1</kbd> or from a previous response from this module.\";'),('it','messages:api-help-authmanagerhelper-returnurl','s:577:\"URL di ritorno per i flussi di autenticazione di terze parti, deve essere assoluto. E\' necessario fornirlo, oppure va fornito <var>$1continue</var>.\n\nAlla ricezione di una risposta <samp>REDIRECT</samp>, in genere si apre un browser o una vista web all\'URL specificato <samp>redirecttarget</samp> per un flusso di autenticazione di terze parti. Quando questo è completato, la terza parte invierà il browser o la vista web a questo URL. Dovresti estrarre qualsiasi parametro POST o della richiesta dall\'URL e passarli come un request <var>$1continue</var> a questo modulo API.\";'),('it','messages:api-help-datatype-boolean','s:168:\"Boolean parameters work like HTML checkboxes: if the parameter is specified, regardless of value, it is considered true. For a false value, omit the parameter entirely.\";'),('it','messages:api-help-datatype-expiry','s:230:\"Expiry values be relative (e.g. <kbd>5 months</kbd> or <kbd>2 weeks</kbd>) or absolute (e.g. <kbd>2014-09-18T12:34:56Z</kbd>). For no expiry, use <kbd>infinite</kbd>, <kbd>indefinite</kbd>, <kbd>infinity</kbd> or <kbd>never</kbd>.\";'),('it','messages:api-help-datatype-timestamp','s:388:\"Timestamps may be specified in several formats, see [[mw:Special:MyLanguage/Timestamp|the Timestamp library input formats documented on mediawiki.org]] for details. ISO 8601 date and time is recommended: <kbd><var>2001</var>-<var>01</var>-<var>15</var>T<var>14</var>:<var>56</var>:<var>00</var>Z</kbd>. Additionally, the string <kbd>now</kbd> may be used to specify the current timestamp.\";'),('it','messages:api-help-datatypes-header','s:12:\"Tipi di dato\";'),('it','messages:api-help-datatypes-top','s:616:\"Input to MediaWiki should be NFC-normalized UTF-8. MediaWiki may attempt to convert other input, but this may cause some operations (such as [[Special:ApiHelp/edit|edits]] with MD5 checks) to fail.\n\nParameters that take multiple values are normally submitted with the values separated using the pipe character, e.g. <kbd>param=value1|value2</kbd> or <kbd>param=value1%7Cvalue2</kbd>. If a value must contain the pipe character, use U+001F (Unit Separator) as the separator \'\'and\'\' prefix the value with U+001F, e.g. <kbd>param=%1Fvalue1%1Fvalue2</kbd>.\n\nSome parameter types in API requests need further explanation:\";'),('it','messages:api-help-examples','s:29:\"{{PLURAL:$1|Esempio|Esempi}}:\";'),('it','messages:api-help-flag-deprecated','s:27:\"Questo modulo è deprecato.\";'),('it','messages:api-help-flag-generator','s:53:\"Questo modulo può essere utilizzato come generatore.\";'),('it','messages:api-help-flag-internal','s:109:\"<strong>Questo modulo è interno o instabile.</strong> Il suo funzionamento potrebbe variare senza preavviso.\";')