y result in fewer than <var>$1limit</var> results returned before continuing; in extreme cases, zero results may be returned.\";'),('it','messages:api-help-param-multi-all','s:55:\"Per specificare tutti i valori, utilizza <kbd>$1</kbd>.\";'),('it','messages:api-help-param-multi-separate','s:87:\"Separa i valori con <kbd>|</kbd> o [[Special:ApiHelp/main#main/datatypes|alternativa]].\";'),('it','messages:api-help-param-no-description','s:56:\"<span class=\"apihelp-empty\">(nessuna descrizione)</span>\";'),('it','messages:api-help-param-templated','s:105:\"This is a [[Special:ApiHelp/main#main/templatedparams|templated parameter]]. When making the request, $2.\";'),('it','messages:api-help-param-templated-var','s:53:\"<var>&#x7B;$1&#x7D;</var> con valori di <var>$2</var>\";'),('it','messages:api-help-param-templated-var-first','s:97:\"<var>&#x7B;$1&#x7D;</var> in the parameter\'s name should be replaced with values of <var>$2</var>\";'),('it','messages:api-help-param-token','s:85:\"Un token \"$1\" recuperato da [[Special:ApiHelp/query+tokens|action=query&meta=tokens]]\";'),('it','messages:api-help-param-token-webui','s:65:\"For compatibility, the token used in the web UI is also accepted.\";'),('it','messages:api-help-param-type-enum','s:137:\"{{PLURAL:$1|1=Uno dei seguenti valori|2=Valori (separati da <kbd>{{!}}</kbd> o [[Special:ApiHelp/main#main/datatypes|alternativa]])}}: $2\";'),('it','messages:api-help-param-type-expiry','s:103:\"Type: {{PLURAL:$1|1=expiry|2=list of expiries}} ([[Special:ApiHelp/main#main/datatype/expiry|details]])\";'),('it','messages:api-help-param-type-limit','s:29:\"Tipo: intero o <kbd>max</kbd>\";'),('it','messages:api-help-param-type-presenceboolean','s:72:\"Tipo: booleano ([[Special:ApiHelp/main#main/datatype/boolean|dettagli]])\";'),('it','messages:api-help-param-type-timestamp','s:123:\"Tipo: {{PLURAL:$1|1=timestamp|2=elenco di timestamp}} ([[Special:ApiHelp/main#main/datatype/timestamp|formati consentiti]])\";'),('it','messages:api-help-parameters','s:34:\"{{PLURAL:$1|Parametro|Parametri}}:\";'),('it','messages:api-help-permissions','s:32:\"{{PLURAL:$1|Permesso|Permessi}}:\";'),('it','messages:api-help-permissions-granted-to','s:28:\"{{PLURAL:$1|Granted to}}: $2\";'),('it','messages:api-help-right-apihighlimits','s:135:\"Use higher limits in API queries (slow queries: $1; fast queries: $2). The limits for slow queries also apply to multivalue parameters.\";'),('it','messages:api-help-source','s:9:\"Fonte: $1\";'),('it','messages:api-help-source-unknown','s:55:\"Fonte: <span class=\"apihelp-unknown\">sconosciuta</span>\";'),('it','messages:api-help-templatedparams','s:560:\"Templated parameters support cases where an API module needs a value for each value of some other parameter. For example, if there were an API module to request fruit, it might have a parameter <var>fruits</var> to specify which fruits are being requested and a templated parameter <var>{fruit}-quantity</var> to specify how many of each fruit to request. An API client that wants 1 apple, 5 bananas, and 20 strawberries could then make a request like <kbd>fruits=apples|bananas|strawberries&apples-quantity=1&bananas-quantity=5&strawberries-quantity=20</kbd>.\";'),('it','messages:api-help-templatedparams-header','s:18:\"Parametri template\";'),('it','messages:api-help-title','s:18:\"MediaWiki API help\";'),('it','messages:api-help-undocumented-module','s:40:\"Nessuna documentazione per il modulo $1.\";'),('it','messages:api-login-fail-aborted','s:277:\"Authentication requires user interaction, which is not supported by <kbd>action=login</kbd>. To be able to login with <kbd>action=login</kbd>, see [[Special:BotPasswords]]. To continue using main-account login, see <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('it','messages:api-login-fail-aborted-nobotpw','s:170:\"Authentication requires user interaction, which is not supported by <kbd>action=login</kbd>. To log in, see <kbd>[[Special:ApiHelp/clientlogin|action=