:\"Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('it','messages:apihelp-edit-summary','s:23:\"Crea e modifica pagine.\";'),('it','messages:apihelp-emailuser-example-email','s:81:\"Manda una e-mail all\'utente <kbd>WikiSysop</kbd> con il testo <kbd>Content</kbd>.\";'),('it','messages:apihelp-emailuser-param-ccme','s:33:\"Mandami una copia di questa mail.\";'),('it','messages:apihelp-emailuser-param-subject','s:20:\"Oggetto dell\'e-mail.\";'),('it','messages:apihelp-emailuser-param-target','s:30:\"Utente a cui inviare l\'e-mail.\";'),('it','messages:apihelp-emailuser-param-text','s:18:\"Testo dell\'e-mail.\";'),('it','messages:apihelp-emailuser-summary','s:29:\"Manda un\'e-mail ad un utente.\";'),('it','messages:apihelp-expandtemplates-example-simple','s:68:\"Expand the wikitext <kbd><nowiki>{{Project:Sandbox}}</nowiki></kbd>.\";'),('it','messages:apihelp-expandtemplates-param-generatexml','s:55:\"Generate XML parse tree (replaced by $1prop=parsetree).\";'),('it','messages:apihelp-expandtemplates-param-includecomments','s:47:\"Whether to include HTML comments in the output.\";'),('it','messages:apihelp-expandtemplates-param-prop','s:155:\"Quale informazione ottenere.\n\nNota che se non è selezionato alcun valore, il risultato conterrà il codice wiki, ma l\'output sarà in un formato obsoleto.\";'),('it','messages:apihelp-expandtemplates-param-revid','s:84:\"Revision ID, for <code><nowiki>{{REVISIONID}}</nowiki></code> and similar variables.\";'),('it','messages:apihelp-expandtemplates-param-text','s:24:\"Wikitesto da convertire.\";'),('it','messages:apihelp-expandtemplates-param-title','s:20:\"Titolo della pagina.\";'),('it','messages:apihelp-expandtemplates-paramvalue-prop-categories','s:84:\"Any categories present in the input that are not represented in the wikitext output.\";'),('it','messages:apihelp-expandtemplates-paramvalue-prop-encodedjsconfigvars','s:83:\"Gives the JavaScript configuration variables specific to the page as a JSON string.\";'),('it','messages:apihelp-expandtemplates-paramvalue-prop-jsconfigvars','s:66:\"Gives the JavaScript configuration variables specific to the page.\";'),('it','messages:apihelp-expandtemplates-paramvalue-prop-modules','s:203:\"Any ResourceLoader modules that parser functions have requested be added to the output. Either <kbd>jsconfigvars</kbd> or <kbd>encodedjsconfigvars</kbd> must be requested jointly with <kbd>modules</kbd>.\";'),('it','messages:apihelp-expandtemplates-paramvalue-prop-parsetree','s:32:\"The XML parse tree of the input.\";'),('it','messages:apihelp-expandtemplates-paramvalue-prop-properties','s:75:\"Proprietà della pagina definite dalle parole magiche estese nel wikitesto.\";'),('it','messages:apihelp-expandtemplates-paramvalue-prop-ttl','s:111:\"Il tempo massimo dopo il quale le memorizzazioni temporanee (cache) del risultato dovrebbero essere invalidate.\";'),('it','messages:apihelp-expandtemplates-paramvalue-prop-volatile','s:90:\"Se l\'output sia volatile e non debba essere riutilizzato altrove all\'interno della pagina.\";'),('it','messages:apihelp-expandtemplates-paramvalue-prop-wikitext','s:20:\"Il wikitext espanso.\";'),('it','messages:apihelp-expandtemplates-summary','s:51:\"Espande tutti i template all\'interno del wikitesto.\";'),('it','messages:apihelp-feedcontributions-example-simple','s:55:\"Restituisce contributi per l\'utente <kbd>Example</kbd>.\";'),('it','messages:apihelp-feedcontributions-param-deletedonly','s:37:\"Mostra solo i contribuiti cancellati.\";'),('it','messages:apihelp-feedcontributions-param-feedformat','s:20:\"Il formato del feed.\";'),('it','messages:apihelp-feedcontributions-param-hideminor','s:29:\"Nascondi le modifiche minori.\";'),('it','messages:apihelp-feedcontributions-param-month','s:24:\"Dal mese (e precedenti).\";'),('it','messages:apihelp-feedcontributions-param-namespace','s:47:\"Which namespace to filter the contributions by.\";'),('it','messages:apihelp-feedcontributions-param-newonly','s:58:\"Visualizza solo le modifiche che sono creazioni di pagina.\";'),('it','messages:apihelp-feedcontributions-param-showsizediff','s:51:\"Mostra la differenza di dimensioni tra le versioni.\";'),('it','messages:apihelp-feedcontributions-param-tagfilter','s:45:\"Filtra contributi che hanno queste etichette.\";'),('it','messages:apihelp-feedcontributions-param-toponly','s:67:\"Mostra solo i contributi che sono le ultime versioni per la pagina.\";'),('it','messages:apihelp-feedcontributions-param-user','s:40:\"What users to get the contributions for.\";'),('it','messages:apihelp-feedcontributions-param-year','s:25:\"Dall\'anno (e precedenti).\";'),('it','messages:apihelp-feedcontributions-summary','s:36:\"Returns a user\'s contributions feed.\";'),('it','messages:apihelp-feedrecentchanges-example-30days','s:43:\"Mostra le modifiche degli ultimi 30 giorni.\";'),('it','messages:apihelp-feedrecentchanges-example-simple','s:27:\"Mostra le ultime modifiche.\";'),('it','messages:apihelp-feedrecentchanges-param-associated','s:54:\"Includi namespace associato (discussione o principale)\";'),('it','messages:apihelp-feedrecentchanges-param-days','s:54:\"Intervallo di giorni per i quali limitare i risultati.\";'),('it','messages:apihelp-feedrecentchanges-param-feedformat','s:20:\"Il formato del feed.\";'),('it','messages:apihelp-feedrecentchanges-param-from','s:31:\"Mostra i cambiamenti da allora.\";'),('it','messages:apihelp-feedrecentchanges-param-hideanons','s:46:\"Nascondi le modifiche fatte da utenti anonimi.\";'),('it','messages:apihelp-feedrecentchanges-param-hidebots','s:39:\"Nascondi le modifiche apportate da bot.\";'),('it','messages:apihelp-feedrecentchanges-param-hidecategorization','s:54:\"Nascondi le variazioni di appartenenza alle categorie.\";'),('it','messages:apihelp-feedrecentchanges-param-hideliu','s:56:\"Nascondi le modifiche apportate dagli utenti registrati.\";'),('it','messages:apihelp-feedrecentchanges-param-hideminor','s:29:\"Na