ihelp-filerevert-param-comment','s:25:\"Commento sul caricamento.\";'),('it','messages:apihelp-filerevert-param-filename','s:57:\"Nome del file di destinazione, senza il prefisso \'File:\'.\";'),('it','messages:apihelp-filerevert-summary','s:46:\"Ripristina un file ad una versione precedente.\";'),('it','messages:apihelp-format-example-generic','s:41:\"Return the query result in the $1 format.\";'),('it','messages:apihelp-format-param-wrappedhtml','s:91:\"Restituisce l\'HTML ben formattato e i moduli ResourceLoader associati come un oggetto JSON.\";'),('it','messages:apihelp-help-example-help','s:36:\"Aiuto per lo stesso modulo di aiuto.\";'),('it','messages:apihelp-help-example-main','s:31:\"Aiuto per il modulo principale.\";'),('it','messages:apihelp-help-example-query','s:30:\"Help for two query submodules.\";'),('it','messages:apihelp-help-example-recursive','s:30:\"Tutti gli aiuti in una pagina.\";'),('it','messages:apihelp-help-example-submodules','s:62:\"Aiuto per <kbd>action=query</kbd> e tutti i suoi sotto-moduli.\";'),('it','messages:apihelp-help-param-helpformat','s:26:\"Format of the help output.\";'),('it','messages:apihelp-help-param-modules','s:159:\"Modules to display help for (values of the <var>action</var> and <var>format</var> parameters, or <kbd>main</kbd>). Can specify submodules with a <kbd>+</kbd>.\";'),('it','messages:apihelp-help-param-recursivesubmodules','s:40:\"Include help for submodules recursively.\";'),('it','messages:apihelp-help-param-submodules','s:48:\"Include help for submodules of the named module.\";'),('it','messages:apihelp-help-param-toc','s:35:\"Includi un indice nell\'output HTML.\";'),('it','messages:apihelp-help-param-wrap','s:53:\"Wrap the output in a standard API response structure.\";'),('it','messages:apihelp-help-summary','s:41:\"Mostra la guida per i moduli specificati.\";'),('it','messages:apihelp-imagerotate-example-generator','s:76:\"Ruota tutte le immagini in <kbd>Category:Flip</kbd> di <kbd>180</kbd> gradi.\";'),('it','messages:apihelp-imagerotate-example-simple','s:57:\"Ruota <kbd>File:Example.png</kbd> di <kbd>90</kbd> gradi.\";'),('it','messages:apihelp-imagerotate-param-rotation','s:49:\"Gradi di rotazione dell\'immagine in senso orario.\";'),('it','messages:apihelp-imagerotate-param-tags','s:45:\"Tags to apply to the entry in the upload log.\";'),('it','messages:apihelp-imagerotate-summary','s:26:\"Ruota una o più immagini.\";'),('it','messages:apihelp-import-example-import','s:80:\"Importa [[meta:Help:ParserFunctions]] nel namespace 100 con cronologia completa.\";'),('it','messages:apihelp-import-extended-description','s:140:\"Note that the HTTP POST must be done as a file upload (i.e. using multipart/form-data) when sending a file for the <var>xml</var> parameter.\";'),('it','messages:apihelp-import-param-assignknownusers','s:64:\"Assign edits to local users where the named user exists locally.\";'),('it','messages:apihelp-import-param-fullhistory','s:86:\"Per importazioni interwiki: importa l\'intera cronologia, non solo la versione attuale.\";'),('it','messages:apihelp-import-param-interwikipage','s:48:\"Per importazioni interwiki: pagina da importare.\";'),('it','messages:apihelp-import-param-interwikiprefix','s:128:\"For uploaded imports: interwiki prefix to apply to unknown user names (and known users if <var>$1assignknownusers</var> is set).\";'),('it','messages:apihelp-import-param-interwikisource','s:50:\"Per importazioni interwiki: wiki da cui importare.\";'),('it','messages:apihelp-import-param-namespace','s:83:\"Importa in questo namespace. Non può essere usato insieme a <var>$1rootpage</var>.\";'),('it','messages:apihelp-import-param-rootpage','s:98:\"Importa come sottopagina di questa pagina. Non può essere usato insieme a <var>$1namespace</var>.\";'),('it','messages:apihelp-import-param-summary','s:37:\"Oggetto nel registro di importazione.\";'),('it','messages:apihelp-import-param-tags','s:99:\"Change tags to apply to the entry in the import log and to the null revision on the imported pages.\";'),('it','messages:apihelp-import-param-templates','s:67:\"Per importazioni interwiki: importa anche tutti i template inclusi.\";'),('it','messages:apihelp-import-param-xml','s:18:\"File XML caricato.\";'),('it','messages:apihelp-import-summary','s:53:\"Import a page from another wiki, or from an XML file.\";'),('it','messages:apihelp-json-param-ascii','s:126:\"If specified, encodes all non-ASCII using hexadecimal escape sequences. Default when <var>formatversion</var> is <kbd>1</kbd>.\";'),('it','messages:apihelp-json-param-callback','s:113:\"If specified, wraps the output into a given function call. For safety, all user-specific data will be restricted.\";'),('it','messages:apihelp-json-param-formatversion','s:218:\"Output formatting:\n;1:Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\n;2:Modern format.\n;latest:Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),('it','messages:apihelp-json-param-utf8','s:190:\"If specified, encodes most (but not all) non-ASCII characters as UTF-8 instead of replacing them with hexadecimal escape sequences. Default when <var>formatversion</var> is not <kbd>1</kbd>.\";'),('it','messages:apihelp-json-summary','s:27:\"Output data in JSON format.\";'),('it','messages:apihelp-jsonfm-summary','s:50:\"Output data in JSON format (pretty-print in HTML).\";'),('it','messages:apihelp-link','s:25:\"[[Special:ApiHelp/$1|$2]]\";'),('it','messages:apihelp-linkaccount-example-link','s:69:\"Avvia il processo di collegamento ad un\'utenza da <kbd>Example</kbd>.\";'),('it','messages:apihelp-linkaccount-summary','s:76:\"Collegamento di un\'utenza di un provider di terze parti all\'utente corrente.\";'),('it','messages:apihelp-login-example-login','s:6:\"Entra.\";'),('it','messages:apihelp-login-extended-description','s:304:\"Questa azione deve essere usata esclusivamente in combinazione con [[Special:BotPasswords]]; utilizzarla per l\'accesso all\'account principale è deprecato e può fallire senza preavviso. Per accedere in modo sicuro all\'utenza principale, usa <kbd>[[Special:ApiHelp/clientlogin|action=clientlogin]]</kbd>.\";'),('it','messages:apihelp-login-extended-description-nobotpasswords','s:143:\"Questa azione è deprecata e può fallire senza preavviso. Per accedere in modo sicuro, usa [[Special:ApiHelp/clientlogin|action=clientlogin]].\";'),('it','messages:apihelp-login-param-domain','s:20:\"Dominio (opzionale).\";'),('it','messages:apihelp-login-param-name','s:12:\"Nome utente.\";'),('it','messages:apihelp-login-param-password','s:9:\"Password.\";'),('it','messages:apihelp-login-param-token','s:38:\"Login token obtained in first request.\";'),('it','messages:apihelp-login-summary','s:44:\"Accedi e ottieni i cookie di autenticazione.\";'),('it','messages:apihelp-logout-example-logout','s:29:\"Disconnetti l\'utente attuale.\";'),('it','messages:apihelp-logout-summary','s:38:\"Esci e cancella i dati della sessione.\";'),('it','messages:apihelp-main-extended-description','s:1337:\"<div class=\"hlist plainlinks api-main-links\">\n* [[mw:Special:MyLanguage/API:Main_page|Documentazione]] (in inglese)\n* [[mw:Special:MyLanguage/API:FAQ|FAQ]] (in inglese)\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api Mailing list]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-api-announce Annunci sull\'API]\n* [https://phabricator.wikimedia.org/maniphest/query/GebfyV4uCaLd/#R Bug & richieste]\n</div>\n<strong>Stato:</strong> l\'API MediaWiki è un\'interfaccia matura e stabile che è attivamente supportata e migliorata. Anche se cerchiamo di evitarlo, potremmo dover fare delle modifiche che causano malfunzionamenti; iscriviti alla [https://lists.wikimedia.org/pipermail/mediawiki-api-announce/ mailing list sugli annunci delle API MediaWiki] per essere informato sugli aggiornamenti.\n\n<strong>Istruzioni sbagliate:</strong> quando vengono impartite alle API delle istruzioni sbagliate, un\'intestazione HTTP verrà inviata col messaggio \"MediaWiki-API-Error\" e, sia il valore dell\'intestazione, sia il codice d\'errore, verranno impostati con lo stesso valore. Per maggiori informazioni leggi [[mw:Special:MyLanguage/API:Errors_and_warnings|API:Errori ed avvertimenti]] (in inglese).\n\n<p class=\"mw-apisandbox-link\"><strong>Test:</strong> per testare facilmente le richieste API, vedi [[Special:ApiSandbox]].</p>\";'),('it','messages:apihelp-main-param-action','s:19:\"Azione da compiere.\";'),('it','messages:apihelp-main-param-assert','s:224:\"Verifica che l\'utente abbia effettuato l\'accesso se si è impostato <kbd>user</kbd>, <em>non</em> abbia effettuato l\'accesso se si è impostato <kbd>anon</kbd> o che abbia i permessi di bot se si è impostato <kbd>bot</kbd>.\";'),('it','messages:apihelp-main-param-assertuser','s:42:\"Verify the current user is the named user.\";'),('it','messages:apihelp-main-param-curtimestamp','s:43:\"Includi nel risultato il timestamp attuale.\";'),('it','messages:apihelp-main-param-errorformat','s:349:\"Format to use for warning and error text output.\n; plaintext: Wikitext with HTML tags removed and entities replaced.\n; wikitext: Unparsed wikitext.\n; html: HTML.\n; raw: Message key and parameters.\n; none: No text output, only the error codes.\n; bc: Format used prior to MediaWiki 1.29. <var>errorlang</var> and <var>errorsuselocal</var> are ignored.\";'),('it','messages:apihelp-main-param-errorlang','s:336:\"Language to use for warnings and errors. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> with <kbd>siprop=languages</kbd> returns a list of language codes, or specify <kbd>content</kbd> to use this wiki\'s content language, or specify <kbd>uselang</kbd> to use the same value as the <var>uselang</var> parameter.\";'),('it','messages:apihelp-main-param-errorsuselocal','s:95:\"If given, error texts will use locally-customized messages from the {{ns:MediaWiki}} namespace.\";'),('it','messages:apihelp-main-param-format','s:20:\"Formato dell\'output.\";'),('it','messages:apihelp-main-param-maxage','s:101:\"Set the <code>max-age</code> HTTP cache control header to this many seconds. Errors are never cached.\";'),('it','messages:apihelp-main-param-maxlag','s:488:\"Maximum lag can be used when MediaWiki is installed on a database replicated cluster. To save actions causing any more site replication lag, this parameter can make the client wait until the replication lag is less than the specified value. In case of excessive lag, error code <samp>maxlag</samp> is returned with a message like <samp>Waiting for $host: $lag seconds lagged</samp>.<br />See [[mw:Special:MyLanguage/Manual:Maxlag_parameter|Manual: Maxlag parameter]] for more information.\";'),('it','messages:apihelp-main-param-origin','s:1009:\"When accessing the API using a cross-domain AJAX request (CORS), set this to the originating domain. This must be included in any pre-flight request, and therefore must be part of the request URI (not the POST body).\n\nFor authenticated requests, this must match one of the origins in the <code>Origin</code> header exactly, so it has to be set to something like <kbd>https://en.wikipedia.org</kbd> or <kbd>https://meta.wikimedia.org</kbd>. If this parameter does not match the <code>Origin</code> header, a 403 response will be returned. If this parameter matches the <code>Origin</code> header and the origin is whitelisted, the <code>Access-Control-Allow-Origin</code> and <code>Access-Control-Allow-Credentials</code> headers will be set.\n\nFor non-authenticated requests, specify the value <kbd>*</kbd>. This will cause the <code>Access-Control-Allow-Origin</code> header to be set, but <code>Access-Control-Allow-Credentials</code> will be <code>false</code> and all user-specific data will be restricted.\";'),('it','messages:apihelp-main-param-requestid','s:117:\"Tutti i valori forniti saranno implementati nella risposta. Potrebbero venir utilizzati per distinguere le richieste.\";'),('it','messages:apihelp-main-param-responselanginfo','s:89:\"Include the languages used for <var>uselang</var> and <var>errorlang</var> in the result.\";'),('it','messages:apihelp-main-param-servedby','s:68:\"Includi nel risultato il nome dell\'host che ha servito la richiesta.\";'),('it','messages:apihelp-main-param-smaxage','s:102:\"Set the <code>s-maxage</code> HTTP cache control header to this many seconds. Errors are never cached.\";'),('it','messages:apihelp-main-param-uselang','s:322:\"Language to use for message translations. <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd> with <kbd>siprop=languages</kbd> returns a list of language codes, or specify <kbd>user</kbd> to use the current user\'s language preference, or specify <kbd>content</kbd> to use this wiki\'s content language.\";'),('it','messages:apihelp-main-summary','s:0:\"\";'),('it','messages:apihelp-managetags-example-activate','s:90:\"Activate a tag named <kbd>spam</kbd> with the reason <kbd>For use in edit patrolling</kbd>\";'),('it','messages:apihelp-managetags-example-create','s:88:\"Create a tag named <kbd>spam</kbd> with the reason <kbd>For use in edit patrolling</kbd>\";'),('it','messages:apihelp-managetags-example-deactivate','s:84:\"Deactivate a tag named <kbd>spam</kbd> with the reason <kbd>No longer required</kbd>\";'),('it','messages:apihelp-managetags-example-delete','s:71:\"Delete the <kbd>vandlaism</kbd> tag with the reason <kbd>Misspelt</kbd>\";'),('it','messages:apihelp-managetags-param-ignorewarnings','s:68:\"Whether to ignore any warnings that are issued during the operation.\";'),('it','messages:apihelp-managetags-param-operation','s:379:\"Which operation to perform:\n;create:Create a new change tag for manual use.\n;delete:Remove a change tag from the database, including removing the tag from all revisions, recent change entries and log entries on which it is used.\n;activate:Activate a change tag, allowing users to apply it manually.\n;deactivate:Deactivate a change tag, preventing users from applying it manually.\";'),('it','messages:apihelp-managetags-param-reason','s:78:\"An optional reason for creating, deleting, activating or deactivating the tag.\";'),('it','messages:apihelp-managetags-param-tag','s:277:\"Tag to create, delete, activate or deactivate. For tag creation, the tag must not exist. For tag deletion, the tag must exist. For tag activation, the tag must exist and not be in use by an extension. For tag deactivation, the tag must be currently active and manually defined.\";'),('it','messages:apihelp-managetags-param-tags','s:60:\"Change tags to apply to the entry in the tag management log.\";'),('it','messages:apihelp-managetags-summary','s:49:\"Perform management tasks relating to change tags.\";'),('it','messages:apihelp-mergehistory-example-merge','s:71:\"Unisci l\'intera cronologia di <kbd>Oldpage</kbd> in <kbd>Newpage</kbd>.\";'),('it','messages:apihelp-mergehistory-example-merge-timestamp','s:112:\"Unisci le versioni della pagina <kbd>Oldpage</kbd> fino a <kbd>2015-12-31T04:37:41Z</kbd> in <kbd>Newpage</kbd>.\";'),('it','messages:apihelp-mergehistory-param-from','s:106:\"Il titolo della pagina da cui cronologia sarà unita. Non può essere usato insieme a <var>$1fromid</var>.\";'),('it','messages:apihelp-mergehistory-param-fromid','s:99:\"L\'ID della pagina da cui cronologia sarà unita. Non può essere usato insieme a <var>$1from</var>.\";'),('it','messages:apihelp-mergehistory-param-reason','s:37:\"Motivo per l\'unione della cronologia.\";'),('it','messages:apihelp-mergehistory-param-timestamp','s:229:\"Il timestamp fino a cui le versioni saranno spostate dalla cronologia della pagina di origine a quella della pagina di destinazione. Se omesso, l\'intera cronologia della pagina di origine sarà unita nella pagina di destinazione.\";'),('it','messages:apihelp-mergehistory-param-to','s:104:\"Il titolo della pagina in cui cronologia sarà unita. Non può essere usato insieme a <var>$1toid</var>.\";'),('it','messages:apihelp-mergehistory-param-toid','s:97:\"L\'ID della pagina in cui cronologia sarà unita. Non può essere usato insieme a <var>$1to</var>.\";'),('it','messages:apihelp-mergehistory-summary','s:25:\"Unisce cronologie pagine.\";'),('it','messages:apihelp-move-example-move','s:74:\"Sposta <kbd>Badtitle</kbd> a <kbd>Goodtitle</kbd> senza lasciare redirect.\";'),('it','messages:apihelp-move-param-from','s:78:\"Title of the page to rename. Cannot be used together with <var>$1fromid</var>.\";'),('it','messages:apihelp-move-param-fromid','s:78:\"Page ID of the page to rename. Cannot be used together with <var>$1from</var>.\";'),('it','messages:apihelp-move-param-ignorewarnings','s:46:\"Ignora i messaggi di avvertimento del sistema.\";'),('it','messages:apihelp-move-param-movesubpages','s:37:\"Rinomina sottopagine, se applicabile.\";'),('it','messages:apihelp-move-param-movetalk','s:45:\"Rinomina la pagina di discussione, se esiste.\";'),('it','messages:apihelp-move-param-noredirect','s:21:\"Non creare un rinvio.\";'),('it','messages:apihelp-move-param-reason','s:22:\"Motivo della rinomina.\";'),('it','messages:apihelp-move-param-tags','s:99:\"Change tags to apply to the entry in the move log and to the null revision on the destination page.\";'),('it','messages:apihelp-move-param-to','s:32:\"Titolo a cui spostare la pagina.\";'),('it','messages:apihelp-move-param-unwatch','s:77:\"Rimuovi la pagina e il redirect dagli osservati speciali dell\'utente attuale.\";'),('it','messages:apihelp-move-param-watch','s:77:\"Aggiunge la pagina e il redirect agli osservati speciali dell\'utente attuale.\";'),('it','messages:apihelp-move-param-watchlist','s:113:\"Unconditionally add or remove the page from the current user\'s watchlist, use preferences or do not change watch.\";'),('it','messages:apihelp-move-param-watchlistexpiry','s:95:\"Watchlist expiry timestamp. Omit this parameter entirely to leave the current expiry unchanged.\";'),('it','messages:apihelp-move-summary','s:18:\"Sposta una pagina.\";'),('it','messages:apihelp-no-such-module','s:24:\"Modulo \"$1\" non trovato.\";'),('it','messages:apihelp-none-summary','s:15:\"Output nothing.\";'),('it','messages:apihelp-opensearch-example-te','s:47:\"Trova le pagine che iniziano con <kbd>Te</kbd>.\";'),('it','messages:apihelp-opensearch-param-format','s:23:\"Il formato dell\'output.\";'),('it','messages:apihelp-opensearch-param-limit','s:42:\"Numero massimo di risultati da restituire.\";'),('it','messages:apihelp-opensearch-param-namespace','s:90:\"Namespaces to search. Ignored if <var>$1search</var> begins with a valid namespace prefix.\";'),('it','messages:apihelp-opensearch-param-redirects','s:231:\"How to handle redirects:\n;return:Return the redirect itself.\n;resolve:Return the target page. May return fewer than $1limit results.\nFor historical reasons, the default is \"return\" for $1format=json and \"resolve\" for other formats.\";'),('it','messages:apihelp-opensearch-param-search','s:19:\"Stringa di ricerca.\";'),('it','messages:apihelp-opensearch-param-suggest','s:15:\"Non più usato.\";'),('it','messages:apihelp-opensearch-param-warningsaserror','s:97:\"If warnings are raised with <kbd>format=json</kbd>, return an API error instead of ignoring them.\";'),('it','messages:apihelp-opensearch-summary','s:46:\"Search the wiki using the OpenSearch protocol.\";'),('it','messages:apihelp-options-example-change','s:60:\"Change <kbd>skin</kbd> and <kbd>hideminor</kbd> preferences.\";'),('it','messages:apihelp-options-example-complex','s:72:\"Reset all preferences, then set <kbd>skin</kbd> and <kbd>nickname</kbd>.\";'),('it','messages:apihelp-options-example-reset','s:30:\"Reimposta tutte le preferenze.\";'),('it','messages:apihelp-options-extended-description','s:183:\"Only options which are registered in core or in one of installed extensions, or options with keys prefixed with <code>userjs-</code> (intended to be used by user scripts), can be set.\";'),('it','messages:apihelp-options-param-change','s:358:\"List of changes, formatted name=value (e.g. skin=vector). If no value is given (not even an equals sign), e.g., optionname|otheroption|..., the option will be reset to its default value. If any value passed contains the pipe character (<kbd>|</kbd>), use the [[Special:ApiHelp/main#main/datatypes|alternative multiple-value separator]] for correct operation.\";'),('it','messages:apihelp-options-param-optionname','s:89:\"The name of the option that should be set to the value given by <var>$1optionvalue</var>.\";'),('it','messages:apihelp-options-param-optionvalue','s:63:\"Il valore per l\'opzione specificata da <var>$1optionname</var>.\";'),('it','messages:apihelp-options-param-reset','s:40:\"Resets preferences to the site defaults.\";'),('it','messages:apihelp-options-param-resetkinds','s:76:\"List of types of options to reset when the <var>$1reset</var> option is set.\";'),('it','messages:apihelp-options-summary','s:39:\"Change preferences of the current user.\";'),('it','messages:apihelp-paraminfo-example-1','s:269:\"Show info for <kbd>[[Special:ApiHelp/parse|action=parse]]</kbd>, <kbd>[[Special:ApiHelp/jsonfm|format=jsonfm]]</kbd>, <kbd>[[Special:ApiHelp/query+allpages|action=query&list=allpages]]</kbd>, and <kbd>[[Special:ApiHelp/query+siteinfo|action=query&meta=siteinfo]]</kbd>.\";'),('it','messages:apihelp-paraminfo-example-2','s:82:\"Show info for all submodules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd>.\";'),('it','messages:apihelp-paraminfo-param-formatmodules','s:101:\"List of format module names (value of <var>format</var> parameter). Use <var>$1modules</var> instead.\";'),('it','messages:apihelp-paraminfo-param-helpformat','s:32:\"Formato delle stringhe di aiuto.\";'),('it','messages:apihelp-paraminfo-param-mainmodule','s:97:\"Get information about the main (top-level) module as well. Use <kbd>$1modules=main</kbd> instead.\";'),('it','messages:apihelp-paraminfo-param-modules','s:241:\"List of module names (values of the <var>action</var> and <var>format</var> parameters, or <kbd>main</kbd>). Can specify submodules with a <kbd>+</kbd>, or all submodules with <kbd>+*</kbd>, or all submodules recursively with <kbd>+**</kbd>.\";'),('it','messages:apihelp-paraminfo-param-pagesetmodule','s:81:\"Get information about the pageset module (providing titles= and friends) as well.\";'),('it','messages:apihelp-paraminfo-param-querymodules','s:177:\"List of query module names (value of <var>prop</var>, <var>meta</var> or <var>list</var> parameter). Use <kbd>$1modules=query+foo</kbd> instead of <kbd>$1querymodules=foo</kbd>.\";'),('it','messages:apihelp-paraminfo-summary','s:36:\"Ottieni informazioni sui moduli API.\";'),('it','messages:apihelp-parse-example-page','s:13:\"Parse a page.\";'),('it','messages:apihelp-parse-example-summary','s:20:\"Analizza un oggetto.\";'),('it','messages:apihelp-parse-example-text','s:18:\"Analizza wikitext.\";'),('it','messages:apihelp-parse-example-texttitle','s:55:\"Analizza wikitext, specificando il titolo della pagina.\";'),('it','messages:apihelp-parse-extended-description','s:500:\"See the various prop-modules of <kbd>[[Special:ApiHelp/query|action=query]]</kbd> to get information from the current version of a page.\n\nThere are several ways to specify the text to parse:\n# Specify a page or revision, using <var>$1page</var>, <var>$1pageid</var>, or <var>$1oldid</var>.\n# Specify content explicitly, using <var>$1text</var>, <var>$1title</var>, <var>$1revid</var>, and <var>$1contentmodel</var>.\n# Specify only a summary to parse. <var>$1prop</var> should be given an empty value.\";'),('it','messages:apihelp-parse-param-contentformat','s:87:\"Content serialization format used for the input text. Only valid when used with $1text.\";'),('it','messages:apihelp-parse-param-contentmodel','s:159:\"Content model of the input text. If omitted, $1title must be specified, and default will be the model of the specified title. Only valid when used with $1text.\";'),('it','messages:apihelp-parse-param-disableeditsection','s:47:\"Omit edit section links from the parser output.\";'),('it','messages:apihelp-parse-param-disablelimitreport','s:68:\"Omit the limit report (\"NewPP limit report\") from the parser output.\";'),('it','messages:apihelp-parse-param-disablepp','s:44:\"Use <var>$1disablelimitreport</var> instead.\";'),('it','messages:apihelp-parse-param-disablestylededuplication','s:59:\"Do not deduplicate inline stylesheets in the parser output.\";'),('it','messages:apihelp-parse-param-disabletoc','s:33:\"Omit table of contents in output.\";'),('it','messages:apihelp-parse-param-effectivelanglinks','s:90:\"Includes language links supplied by extensions (for use with <kbd>$1prop=langlinks</kbd>).\";'),('it','messages:apihelp-parse-param-generatexml','s:106:\"Generate XML parse tree (requires content model <code>$1</code>; replaced by <kbd>$2prop=parsetree</kbd>).\";'),('it','messages:apihelp-parse-param-oldid','s:88:\"Parse the content of this revision. Overrides <var>$1page</var> and <var>$1pageid</var>.\";'),('it','messages:apihelp-parse-param-onlypst','s:165:\"Do a pre-save transform (PST) on the input, but don\'t parse it. Returns the same wikitext, after a PST has been applied. Only valid when used with <var>$1text</var>.\";'),('it','messages:apihelp-parse-param-page','s:102:\"Parse the content of this page. Cannot be used together with <var>$1text</var> and <var>$1title</var>.\";'),('it','messages:apihelp-parse-param-pageid','s:60:\"Parse the content of this page. Overrides <var>$1page</var>.\";'),('it','messages:apihelp-parse-param-preview','s:22:\"Parse in preview mode.\";'),('it','messages:apihelp-parse-param-prop','s:28:\"Quali informazioni ottenere:\";'),('it','messages:apihelp-parse-param-pst','s:87:\"Do a pre-save transform on the input before parsing it. Only valid when used with text.\";'),('it','messages:apihelp-parse-param-redirects','s:90:\"Se <var>$1page</var> o <var>$1pageid</var> è impostato come reindirizzamento, lo risolve.\";'),('it','messages:apihelp-parse-param-revid','s:84:\"Revision ID, for <code><nowiki>{{REVISIONID}}</nowiki></code> and similar variables.\";'),('it','messages:apihelp-parse-param-section','s:227:\"Only parse the content of this section number.\n\nWhen <kbd>new</kbd>, parse <var>$1text</var> and <var>$1sectiontitle</var> as if adding a new section to the page.\n\n<kbd>new</kbd> is allowed only when specifying <var>text</var>.\";'),('it','messages:apihelp-parse-param-sectionpreview','s:57:\"Parse in section preview mode (enables preview mode too).\";'),('it','messages:apihelp-parse-param-sectiontitle','s:151:\"New section title when <var>section</var> is <kbd>new</kbd>.\n\nUnlike page editing, this does not fall back to <var>summary</var> when omitted or empty.\";'),('it','messages:apihelp-parse-param-summary','s:22:\"Oggetto da analizzare.\";'),('it','messages:apihelp-parse-param-text','s:96:\"Text to parse. Use <var>$1title</var> or <var>$1contentmodel</var> to control the content model.\";'),('it','messages:apihelp-parse-param-title','s:130:\"Title of page the text belongs to. If omitted, <var>$1contentmodel</var> must be specified, and [[API]] will be used as the title.\";'),('it','messages:apihelp-parse-param-useskin','s:194:\"Apply the selected skin to the parser output. May affect the following properties: <kbd>langlinks</kbd>, <kbd>headitems</kbd>, <kbd>modules</kbd>, <kbd>jsconfigvars</kbd>, <kbd>indicators</kbd>.\";'),('it','messages:apihelp-parse-param-wrapoutputclass','s:43:\"CSS class to use to wrap the parser output.\";'),('it','messages:apihelp-parse-paramvalue-prop-categories','s:44:\"Gives the categories in the parsed wikitext.\";'),('it','messages:apihelp-parse-paramvalue-prop-categorieshtml','s:41:\"Gives the HTML version of the categories.\";'),('it','messages:apihelp-parse-paramvalue-prop-displaytitle','s:38:\"Adds the title of the parsed wikitext.\";'),('it','messages:apihelp-parse-paramvalue-prop-encodedjsconfigvars','s:83:\"Gives the JavaScript configuration variables specific to the page as a JSON string.\";'),('it','messages:apihelp-parse-paramvalue-prop-externallinks','s:48:\"Gives the external links in the parsed wikitext.\";'),('it','messages:apihelp-parse-paramvalue-prop-headhtml','s:141:\"Gives parsed doctype, opening <code>&lt;html&gt;</code>, <code>&lt;head&gt;</code> element and opening <code>&lt;body&gt;</code> of the page.\";'),('it','messages:apihelp-parse-paramvalue-prop-headitems','s:64:\"Gives items to put in the <code>&lt;head&gt;</code> of the page.\";'),('it','messages:apihelp-parse-paramvalue-prop-images','s:40:\"Gives the images in the parsed wikitext.\";'),('it','messages:apihelp-parse-paramvalue-prop-indicators','s:58:\"Gives the HTML of page status indicators used on the page.\";'),('it','messages:apihelp-parse-paramvalue-prop-iwlinks','s:45:\"Gives interwiki links in the parsed wikitext.\";'),('it','messages:apihelp-parse-paramvalue-prop-jsconfigvars','s:110:\"Gives the JavaScript configuration variables specific to the page. To apply, use <code>mw.config.set()</code>.\";'),('it','messages:apihelp-parse-paramvalue-prop-langlinks','s:48:\"Gives the language links in the parsed wikitext.\";'),('it','messages:apihelp-parse-paramvalue-prop-limitreportdata','s:103:\"Gives the limit report in a structured way. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),('it','messages:apihelp-parse-paramvalue-prop-limitreporthtml','s:103:\"Gives the HTML version of the limit report. Gives no data, when <var>$1disablelimitreport</var> is set.\";'),('it','messages:apihelp-parse-paramvalue-prop-links','s:48:\"Gives the internal links in the parsed wikitext.\";'),('it','messages:apihelp-parse-paramvalue-prop-modules','s:211:\"Gives the ResourceLoader modules used on the page. To load, use <code>mw.loader.using()</code>. Either <kbd>jsconfigvars</kbd> or <kbd>encodedjsconfigvars</kbd> must be requested jointly with <kbd>modules</kbd>.\";'),('it','messages:apihelp-parse-paramvalue-prop-parsetree','s:79:\"The XML parse tree of revision content (requires content model <code>$1</code>)\";'),('it','messages:apihelp-parse-paramvalue-prop-parsewarnings','s:55:\"Gives the warnings that occurred while parsing content.\";'),('it','messages:apihelp-parse-paramvalue-prop-properties','s:56:\"Gives various properties defined in the parsed wikitext.\";'),('it','messages:apihelp-parse-paramvalue-prop-revid','s:40:\"Adds the revision ID of the parsed page.\";'),('it','messages:apihelp-parse-paramvalue-prop-sections','s:42:\"Gives the sections in the parsed wikitext.\";'),('it','messages:apihelp-parse-paramvalue-prop-templates','s:43:\"Gives the templates in the parsed wikitext.\";'),('it','messages:apihelp-parse-paramvalue-prop-text','s:38:\"Gives the parsed text of the wikitext.\";'),('it','messages:apihelp-parse-paramvalue-prop-wikitext','s:44:\"Gives the original wikitext that was parsed.\";'),('it','messages:apihelp-parse-summary','s:41:\"Parses content and returns parser output.\";'),('it','messages:apihelp-patrol-example-rcid','s:30:\"Verifica una modifica recente.\";'),('it','messages:apihelp-patrol-example-revid','s:22:\"Verifica una versione.\";'),('it','messages:apihelp-patrol-param-rcid','s:40:\"ID della modifica recente da verificare.\";'),('it','messages:apihelp-patrol-param-revid','s:26:\"ID versione da verificare.\";'),('it','messages:apihelp-patrol-param-tags','s:74:\"Modifica etichette da applicare all\'elemento del registro delle verifiche.\";'),('it','messages:apihelp-patrol-summary','s:31:\"Verifica una pagina o versione.\";'),('it','messages:apihelp-php-param-formatversion','s:218:\"Output formatting:\n;1:Backwards-compatible format (XML-style booleans, <samp>*</samp> keys for content nodes, etc.).\n;2:Modern format.\n;latest:Use the latest format (currently <kbd>2</kbd>), may change without warning.\";'),('it','messages:apihelp-php-summary','s:37:\"Output data in serialized PHP format.\";'),('it','mess