ons-example-revids','s:68:\"Elenca le informazioni per la versione cancellata <kbd>123456</kbd>.\";'),('it','messages:apihelp-query+deletedrevisions-example-titles','s:110:\"Elenca le versioni cancellate delle pagine <kbd>Main Page</kbd> e <kbd>Talk:Main Page</kbd>, con il contenuto.\";'),('it','messages:apihelp-query+deletedrevisions-extended-description','s:236:\"May be used in several ways:\n# Get deleted revisions for a set of pages, by setting titles or pageids. Ordered by title and timestamp.\n# Get data about a set of deleted revisions by setting their IDs with revids. Ordered by revision ID.\";'),('it','messages:apihelp-query+deletedrevisions-param-end','s:97:\"Il timestamp al quale interrompere l\'elenco. Ignorato quando si elabora un elenco di ID versioni.\";'),('it','messages:apihelp-query+deletedrevisions-param-excludeuser','s:42:\"Non elencare le versioni di questo utente.\";'),('it','messages:apihelp-query+deletedrevisions-param-start','s:91:\"Il timestamp da cui iniziare l\'elenco. Ignorato quando si elabora un elenco di ID versioni.\";'),('it','messages:apihelp-query+deletedrevisions-param-tag','s:57:\"Elenca solo le versioni etichettate con questa etichetta.\";'),('it','messages:apihelp-query+deletedrevisions-param-user','s:41:\"Elenca solo le versioni di questo utente.\";'),('it','messages:apihelp-query+deletedrevisions-summary','s:33:\"Get deleted revision information.\";'),('it','messages:apihelp-query+deletedrevs-example-mode1','s:119:\"List the last deleted revisions of the pages <kbd>Main Page</kbd> and <kbd>Talk:Main Page</kbd>, with content (mode 1).\";'),('it','messages:apihelp-query+deletedrevs-example-mode2','s:66:\"List the last 50 deleted contributions by <kbd>Bob</kbd> (mode 2).\";'),('it','messages:apihelp-query+deletedrevs-example-mode3-main','s:67:\"List the first 50 deleted revisions in the main namespace (mode 3).\";'),('it','messages:apihelp-query+deletedrevs-example-mode3-talk','s:70:\"List the first 50 deleted pages in the {{ns:talk}} namespace (mode 3).\";'),('it','messages:apihelp-query+deletedrevs-extended-description','s:378:\"Operates in three modes:\n# List deleted revisions for the given titles, sorted by timestamp.\n# List deleted contributions for the given user, sorted by timestamp (no titles specified).\n# List all deleted revisions in the given namespace, sorted by title and timestamp (no titles specified, $1user not set).\n\nCertain parameters only apply to some modes and are ignored in others.\";'),('it','messages:apihelp-query+deletedrevs-param-end','s:44:\"Il timestamp al quale interrompere l\'elenco.\";'),('it','messages:apihelp-query+deletedrevs-param-excludeuser','s:42:\"Non elencare le versioni di questo utente.\";'),('it','messages:apihelp-query+deletedrevs-param-from','s:30:\"Inizia elenco a questo titolo.\";'),('it','messages:apihelp-query+deletedrevs-param-limit','s:42:\"Il numero massimo di versioni da elencare.\";'),('it','messages:apihelp-query+deletedrevs-param-namespace','s:42:\"Elenca solo le pagine in questo namespace.\";'),('it','messages:apihelp-query+deletedrevs-param-prefix','s:71:\"Ricerca per tutti i titoli delle pagine che iniziano con questo valore.\";'),('it','messages:apihelp-query+deletedrevs-param-prop','s:628:\"Which properties to get:\n;revid:Adds the revision ID of the deleted revision.\n;parentid:Adds the revision ID of the previous revision to the page.\n;user:Adds the user who made the revision.\n;userid:Adds the ID of the user who made the revision.\n;comment:Adds the comment of the revision.\n;parsedcomment:Adds the parsed comment of the revision.\n;minor:Tags if the revision is minor.\n;len:Adds the length (bytes) of the revision.\n;sha1:Adds the SHA-1 (base 16) of the revision.\n;content:Adds the content of the revision.\n;token:<span class=\"apihelp-deprecated\">Deprecated.</span> Gives the edit token.\n;tags:Tags for the revision.\";'),('it','messages:apihelp-query+deletedrevs-param-start','s:38:\"Il timestamp da cui iniziare l\'elenco.\";'),('it','messages:apihelp-query+deletedrevs-param-tag','s:57:\"Elenca solo le versioni etichettate con questa etichetta.\";'),('it','messages:apihelp-query+deletedrevs-param-to','s:34:\"Interrompi elenco a questo titolo.\";'),('it','messages:apihelp-query+deletedrevs-param-unique','s:41:\"Elenca solo una versione per ogni pagina.\";'),('it','messages:apihelp-query+deletedrevs-param-user','s:41:\"Elenca solo le versioni di questo utente.\";'),('it','messages:apihelp-query+deletedrevs-paraminfo-modes','s:28:\"{{PLURAL:$1|Mode|Modes}}: $2\";'),('it','messages:apihelp-query+deletedrevs-summary','s:23:\"List deleted revisions.\";'),('it','messages:apihelp-query+disabled-summary','s:42:\"Questo modulo query è stato disabilitato.\";'),('it','messages:apihelp-query+duplicatefiles-example-generated','s:34:\"Cerca i duplicati di tutti i file.\";'),('it','messages:apihelp-query+duplicatefiles-example-simple','s:56:\"Cerca i duplicati di [[:File:Albert Einstein Head.jpg]].\";'),('it','messages:apihelp-query+duplicatefiles-param-dir','s:29:\"La direzione in cui elencare.\";'),('it','messages:apihelp-query+duplicatefiles-param-limit','s:33:\"Quanti file duplicati restituire.\";'),('it','messages:apihelp-query+duplicatefiles-param-localonly','s:44:\"Look only for files in the local repository.\";'),('it','messages:apihelp-query+duplicatefiles-summary','s:75:\"List all files that are duplicates of the given files based on hash values.\";'),('it','messages:apihelp-query+embeddedin-example-generator','s:66:\"Get information about pages transcluding <kbd>Template:Stub</kbd>.\";'),('it','messages:apihelp-query+embeddedin-example-simple','s:49:\"Show pages transcluding <kbd>Template:Stub</kbd>.\";'),('it','messages:apihelp-query+embeddedin-param-dir','s:29:\"La direzione in cui elencare.\";'),('it','messages:apihelp-query+embeddedin-param-filterredir','s:28:\"How to filter for redirects.\";'),('it','messages:apihelp-query+embeddedin-param-limit','s:32:\"Quante pagine totali restituire.\";'),('it','messages:apihelp-query+embeddedin-param-namespace','s:25:\"Il namespace da elencare.\";'),('it','messages:apihelp-query+embeddedin-param-pageid','s:56:\"Page ID to search. Cannot be used together with $1title.\";'),('it','messages:apihelp-query+embeddedin-param-title','s:55:\"Title to search. Cannot be used together with $1pageid.\";'),('it','messages:apihelp-query+embeddedin-summary','s:76:\"Trova tutte le pagine che incorporano (transclusione) il titolo specificato.\";'),('it','messages:apihelp-query+extlinks-example-simple','s:53:\"Get a list of external links on <kbd>Main Page</kbd>.\";'),('it','messages:apihelp-query+extlinks-param-expandurl','s:58:\"Expand protocol-relative URLs with the canonical protocol.\";'),('it','messages:apihelp-query+extlinks-param-limit','s:31:\"Quanti collegamenti restituire.\";'),('it','messages:apihelp-query+extlinks-param-protocol','s:166:\"Protocol of the URL. If empty and <var>$1query</var> is set, the protocol is <kbd>http</kbd>. Leave both this and <var>$1query</var> empty to list all external links.\";'),('it','messages:apihelp-query+extlinks-param-query','s:107:\"Search string without protocol. Useful for checking whether a certain page contains a certain external url.\";'),('it','messages:apihelp-query+extlinks-summary','s:64:\"Returns all external URLs (not interwikis) from the given pages.\";'),('it','messages:apihelp-query+exturlusage-example-simple','s:59:\"Show pages linking to <kbd>https://www.mediawiki.org</kbd>.\";'),('it','messages:apihelp-query+exturlusage-param-expandurl','s:58:\"Expand protocol-relative URLs with the canonical protocol.\";'),('it','messages:apihelp-query+exturlusage-param-limit','s:25:\"Quante pagine restituire.\";'),('it','messages:apihelp-query+exturlusage-param-namespace','s:24:\"I namespace da elencare.\";'),('it','messages:apihelp-query+exturlusage-param-prop','s:29:\"Quali informazioni includere:\";'),('it','messages:apihelp-query+exturlusage-param-protocol','s:166:\"Prot