\";'),('it','messages:blanknamespace','s:12:\"(Principale)\";'),('it','messages:blankpage','s:12:\"Pagina vuota\";'),('it','messages:block','s:13:\"Blocca utente\";'),('it','messages:block-actions','s:19:\"Azioni da bloccare:\";'),('it','messages:block-expiry','s:20:\"Scadenza del blocco:\";'),('it','messages:block-log-flags-angry-autoblock','s:33:\"blocco automatico avanzato attivo\";'),('it','messages:block-log-flags-anononly','s:19:\"solo utenti anonimi\";'),('it','messages:block-log-flags-hiddenname','s:20:\"nome utente nascosto\";'),('it','messages:block-log-flags-noautoblock','s:29:\"blocco automatico disattivato\";'),('it','messages:block-log-flags-nocreate','s:22:\"registrazione bloccata\";'),('it','messages:block-log-flags-noemail','s:15:\"e-mail bloccate\";'),('it','messages:block-log-flags-nousertalk','s:52:\"non può modificare la propria pagina di discussione\";'),('it','messages:block-options','s:19:\"Opzioni aggiuntive:\";'),('it','messages:block-prevent-edit','s:8:\"Modifica\";'),('it','messages:block-reason','s:7:\"Motivo:\";'),('it','messages:block-target','s:27:\"Nome utente o indirizzo IP:\";'),('it','messages:blocked-mailpassword','s:148:\"Il tuo indirizzo IP è bloccato alla modifica. Per prevenire abusi, non è consentito usare la funzione di recupero password da questo indirizzo IP.\";'),('it','messages:blocked-notice-logextract','s:123:\"Questo utente è attualmente bloccato.\nL\'ultimo elemento del registro dei blocchi è riportato di seguito per informazione:\";'),('it','messages:blockednoreason','s:28:\"nessuna motivazione indicata\";'),('it','messages:blockedtext','s:708:\"<strong>Il tuo nome utente o indirizzo IP è stato bloccato.</strong>\n\nIl blocco è stato imposto da $1. La motivazione del blocco è la seguente: <em>$2</em>.\n\n* Inizio del blocco: $8\n* Scadenza del blocco: $6\n* Destinatario del blocco: $7\n\nPuoi contattare $1 o un altro [[{{MediaWiki:Grouppage-sysop}}|amministratore]] per discutere del blocco.\n\nPuoi usare la funzione \"{{int:emailuser}}\" se hai registrato un indirizzo email valido nelle tue [[Special:Preferences|preferenze]] qualora nell\'applicare il blocco tale funzione non sia stata disabilitata.\n\nL\'indirizzo IP attuale è $3, il numero ID del blocco è #$5.\nSi prega di specificare tutti i dettagli precedenti in qualsiasi richiesta di chiarimento.\";'),('it','messages:blockedtext-composite','s:331:\"<strong>Il tuo nome utente o indirizzo IP sono stati bloccati.</strong>\n\nLa motivazione del blocco è la seguente:\n\n:<em>$2</em>.\n\n* Inizio del blocco: $8\n* Scadenza del blocco più lungo: $6\n\n* $5\n\nL\'indirizzo IP attuale è $3.\nSi prega di specificare tutti i dettagli qui inclusi nel compilare qualsiasi richiesta di chiarimenti.\";'),('it','messages:blockedtext-composite-ids','s:88:\"ID del blocco rilevante: $1 (anche il tuo indirizzo IP potrebbe essere nella lista nera)\";'),('it','messages:blockedtext-composite-no-ids','s:53:\"Il tuo indirizzo IP è contenuto in varie liste nere.\";'),('it','messages:blockedtext-composite-reason','s:58:\"Sono attivi più blocchi sulla tua utenza e/o indirizzo IP\";'),('it','messages:blockedtext-partial','s:444:\"<strong>Alla tua utenza o indirizzo IP è stato vietato di effettuare questa operazione. Potresti ancora eseguire altre azioni in questo sito, come modificare altre pagine.</strong> Puoi vedere tutti i dettagli del blocco su [[Special:MyContributions|contributi dell\'utenza]].\n\nIl blocco è stato effettuato da $1.\n\nLa ragione data è <em>$2</em>.\n\n* Inizio del blocco: $8\n* Scadenza del blocco: $6\n* Destinatario del blocco: $7\n* ID Blocco #$5\";'),('it','messages:blockedtitle','s:16:\"Utente bloccato.\";'),('it','messages:blockip','s:27:\"Blocca {{GENDER:$1|utente}}\";'),('it','messages:blockipsuccesssub','s:15:\"Blocco eseguito\";'),('it','messages:blockipsuccesstext','s:139:\"[[Special:Contributions/$1|$1]] è stato bloccato.<br />\nConsultare la [[Special:BlockList|lista dei blocchi]] per vedere i blocchi attivi.\";'