me precauzione contro gli attacchi JavaScript.</em>\n\n<strong>Se si tratta di un normale tentativo d\'anteprima, riprova.</strong> \nSe il problema persiste, si può tentare di [[Special:UserLogout|scollegarsi]] ed effettuare un nuovo accesso, e controllare che il tuo browser accetti i cookie da questo sito.\";'),('it','messages:expand_templates_preview_fail_html_anon','s:270:\"<em>Poiché {{SITENAME}} ha dell\'HTML grezzo attivato e non hai effettuato l\'accesso, l\'anteprima è nascosta come precauzione contro gli attacchi JavaScript.</em>\n\n<strong>Se si tratta di un normale tentativo d\'anteprima, [[Special:UserLogin|entra]] e riprova.</strong>\";'),('it','messages:expand_templates_remove_comments','s:18:\"Rimuovi i commenti\";'),('it','messages:expand_templates_remove_nowiki','s:37:\"Elimina il tag <nowiki> nel risultato\";'),('it','messages:expand_templates_title','s:37:\"Contesto (per {{FULLPAGENAME}} ecc.):\";'),('it','messages:expand_templates_xml_output','s:21:\"Output in formato XML\";'),('it','messages:expandtemplates','s:18:\"Espandi i template\";'),('it','messages:expansion-depth-exceeded-category','s:59:\"Pagine nelle quali è superata la profondità di espansione\";'),('it','messages:expansion-depth-exceeded-category-desc','s:54:\"La pagina supera la profondità massima di espansione.\";'),('it','messages:expansion-depth-exceeded-warning','s:54:\"Questa pagina ha superato la profondità di espansione\";'),('it','messages:expensive-parserfunction-category','s:47:\"Pagine con troppe chiamate alle funzioni parser\";'),('it','messages:expensive-parserfunction-category-desc','s:202:\"La pagina usa troppe funzioni parser (come <code>#ifexist</code>). Vedi [https://www.mediawiki.org/wiki/Special:MyLanguage/Manual:$wgExpensiveParserFunctionLimit Manual:$wgExpensiveParserFunctionLimit].\";'),('it','messages:expensive-parserfunction-warning','s:156:\"\'\'\'Attenzione:\'\'\' Questa pagina contiene troppe chiamate alle parser functions.\n\nDovrebbe averne meno di $2, al momento ce {{PLURAL:$1|n\'è $1|ne sono $1}}.\";'),('it','messages:expiringblock','s:55:\"scade {{PLURAL:$1|1=l\'$1|8=l\'$1|11=l\'$1|il $1}} alle $2\";'),('it','messages:explainconflict','s:528:\"Un altro utente ha salvato una nuova versione della pagina mentre stavi effettuando le modifiche.\nLa casella di modifica superiore contiene il testo della pagina attualmente online, così come è stato aggiornato dall\'altro utente.\nLa versione con le tue modifiche è invece riportata nella casella di modifica inferiore.\nSe desideri confermarle, devi riportare le tue modifiche nel testo esistente (casella superiore).\nPremendo il pulsante \'$1\', verrà salvato \'\'\'solo\'\'\' il testo contenuto nella casella di modifica superiore.\";'),('it','messages:export','s:14:\"Esporta pagine\";'),('it','messages:export-addcat','s:8:\"Aggiungi\";'),('it','messages:export-addcattext','s:32:\"Aggiungi pagine dalla categoria:\";'),('it','messages:export-addns','s:8:\"Aggiungi\";'),('it','messages:export-addnstext','s:30:\"Aggiungi pagine dal namespace:\";'),('it','messages:export-download','s:33:\"Richiedi il salvataggio come file\";'),('it','messages:export-manual','s:28:\"Aggiungi pagine manualmente:\";'),('it','messages:export-pagelinks','s:47:\"Includi pagine correlate ad una profondità di:\";'),('it','messages:export-submit','s:7:\"Esporta\";'),('it','messages:export-summary','s:0:\"\";'),('it','messages:export-templates','s:18:\"Includi i template\";'),('it','messages:exportall','s:23:\"Esporta tutte le pagine\";'),('it','messages:exportcuronly','s:57:\"Includi solo la versione attuale, non l\'intera cronologia\";'),('it','messages:exportlistauthors','s:58:\"Includi l\'elenco completo dei contributori per ogni pagina\";'),('it','messages:exportnohistory','s:166:\"----\n\'\'\'Nota:\'\'\' l\'esportazione dell\'intera cronologia delle pagine attraverso questa interfaccia è stata disattivata per motivi legati alle prestazioni del sistema.\";'),('it','messages:exporttext','s:712:\"È possibile esportare il testo e la cronologia delle modifiche di una pagina o di un gruppo di pagine in formato XML per importarle in altri siti che utilizzano il software MediaWiki, attraverso la [[Special:Import|pagina delle importazioni]].\n\nPer esportare le pagine indicare i titoli nella casella di testo sottostante, uno per riga, e specificare se si desidera ottenere l\'ultima versione e tutte le versioni precedenti, con i dati della cronologia della pagina, oppure soltanto l\'ultima versione e i dati corrispondenti all\'ultima modifica.\n\nIn quest\'ultimo caso si può anche utilizzare un collegamento, ad esempio [[{{#Special:Export}}/{{MediaWiki:Mainpage}}]] per esportare \"[[{{MediaWiki:Mainpage}}]]\".\";'),('it','messages:external_image_whitelist','s:551:\" #Lasciare questa riga esattamente com\'è<pre>\n#Inserire i frammenti delle espressioni regolari (solo la parte che va fra //) di seguito\n#Queste verranno messe a confronto con gli indirizzi URL delle immagini esterne (hotlinked)\n#Le corrispondenze saranno mostrate come immagini, altrimenti verrà mostrato solo un collegamento\n#Le righe che iniziano con # sono considerate dei commenti\n#La differenza tra maiuscole e minuscole non è significativa\n\n#Inserire sopra questa riga tutti i frammenti di regex. Lasciare questa riga esattamente com\'è</pre>\";'),('it','messages:externaldberror','s:164:\"Si è verificato un errore con il server di autenticazione esterno, oppure non si dispone delle autorizzazioni necessarie per aggiornare il proprio accesso esterno.\";'),('it','messages:faq','s:17:\"Domande frequenti\";'),('it','messages:feb','s:3:\"feb\";'),('it','messages:february','s:8:\"febbraio\";'),('it','messages:february-date','s:11:\"$1 febbraio\";'),('it','messages:february-gen','s:8:\"febbraio\";'),('it','messages:feed-atom','s:4:\"Atom\";'),('it','messages:feed-invalid','s:48:\"Modalità di sottoscrizione del feed non valida.\";'),('it','messages:feed-rss','s:3:\"RSS\";'),('it','messages:feed-unavailabl