INSERT INTO `l10n_cache` VALUES ('it','messages:passwordreset-emaildisabled','s:77:\"Le funzionalità di posta elettronica sono state disabilitate su questa wiki.\";'),('it','messages:passwordreset-emailelement','s:42:\"Nome utente: \n$1\n\nPassword temporanea: \n$2\";'),('it','messages:passwordreset-emailtext-ip','s:593:\"Qualcuno (probabilmente tu, con indirizzo IP $1) ha richiesto l\'invio di una nuova password per l\'accesso a {{SITENAME}} ($4). {{PLURAL:$3|L\'utente associato|Gli utenti associati}} a questo indirizzo email sono:\n\n$2\n\n{{PLURAL:$3|Questa password temporanea scadrà|Queste password temporanee scadranno}} dopo {{PLURAL:$5|un giorno|$5 giorni}}.\nDovresti accedere e scegliere una nuova password ora. \n\nSe non sei stato tu a fare la richiesta, o se ti sei ricordato la password originale e non vuoi più cambiarla, puoi ignorare questo messaggio e continuare ad utilizzare la tua vecchia password.\";'),('it','messages:passwordreset-emailtext-require-email','s:278:\"Comunque, qualora non avessi generato questa richiesta e volessi prevenire e-mail indesiderate , puoi aggiornare le tue impostazioni e-mail qui\n$1.\nPuoi utilizzare sia l\'username che l\'indirizzo e-mail per ripristinare la password.\nCiò può ridurre il numero di tali incidenti.\";'),('it','messages:passwordreset-emailtext-user','s:572:\"L\'utente $1 di {{SITENAME}} ha richiesto l\'invio di una nuova password per l\'accesso a {{SITENAME}} ($4). {{PLURAL:$3|L\'utente associato|Gli utenti associati}} a questo indirizzo email sono:\n\n$2\n\n{{PLURAL:$3|Questa password temporanea scadrà|Queste password temporanee scadranno}} dopo {{PLURAL:$5|un giorno|$5 giorni}}.\nDovresti accedere e scegliere una nuova password ora. \n\nSe non sei stato tu a fare la richiesta, o se ti sei ricordato la password originale e non vuoi più cambiarla, puoi ignorare questo messaggio e continuare al utilizzare la tua vecchia password.\";'),('it','messages:passwordreset-emailtitle','s:36:\"Dettagli dell\'utente su {